INSERT INTO `gk_1` VALUES (1,'When my friend Maxie says, “Have a nice day” with a smile, I know she sincerely cares about what happens to me. I feel loved and secure since another person cares about me and wishes me well.','请根据文中对应问题的句子选择与其表达意思一样的句子','Maxie shows her anxiety to the author.','Maxie really wishes the author a good day.','Maxie encourages the author to stay happy.','Maxie really worries about the author’s security',2,'正确理解作者意思。 “sincerely cares about what happens to me”= “really wishes me a good day”'),(2,'They are spoken at me, not to me. Obviously, the concern for my day and everyone else’s is the management’s attempt to increase business.','请根据文中对应问题的句子选择与其表达意思一样的句子',' The salesgirl is rude.','The salesgirl is bored.','The salesgirl cares about me.','The salesgirl says the words as a routine',4,'obviously表达作者多前一句话的进一步解析或重复强调。 “management’s attempt to increase business”= “they spoken it as a business routine”'),(3,'If a stranger says “Have a nice day” to you, you may find it heart-warming because someone you don’t know has tried to be nice to you.','请根据文中对应问题的句子选择与其表达意思一样的句子','By saying “Have a nice day,” a stranger may try to be polite to you','By saying “Have a nice day,” a stranger may express respect to you','By saying “Have a nice day,” a stranger may give his blessing to you','By saying “Have a nice day,” a stranger may share his pleasure with you',1,'同义转述，heart-warming, nice=polite'),(4,'While the expression may not often be sincere, it is always spoken. The point is that people say it all the time when they like.','请根据文中对应问题的句子选择与其表达意思一样的句子','People say“Have a nice day” sincerely','People say“Have a nice day” as thanks','People say“Have a nice day” as a habit','People say“Have a nice day” encouragingly',3,'同义转述，say it all the time when they like= say it as a habit (routine)'),(5,'Have a nice day!” may be a pleasant gesture or a meaningless expression.<br>Obviously, the concern for my day and everyone else’s is the management’s attempt to increase business.<br>The expression is one of those behaviors that help people get along with each other.<br>While the expression may not often be sincere, it is always spoken. The point is that people say it all the time when they like.','请根据文中对应问题的句子选择与其表达意思一样的句子','Have a Nice Day—a Social Custom','Have a Nice Day—a Pleasant Gesture','Have a Nice Day—a Heart-warming Greeting','Have a Nice Day—a Polite Ending of a Conversation',1,'综合概括，a social custom= a gesture, a expression, to increase business, to get along with people, say it all the time when they like');
