INSERT INTO `gk_2` VALUES (1,'We all know that some things are obviously <ua> right </ua> . For example, it is right to be <cg> kind </cg> to other people. It is also right to <ub> look after </ub> the environment. Some things are clearly wrong, too. For instance, we should not <uc> hurt or bully(欺负) </uc> others, nor should we <ud> litter </ud> . Rules often tell us what is right or wrong.','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',4,'反义辨认'),(2,'We all know that some things are <ua> obviously </ua> right. For example, it is <ub> right </ub> to be kind to other people. It is also right to look after the environment. Some things are <cg> clearly </cg> wrong, too. For instance, we <uc> should not </uc> hurt or bully(欺负) others,  <ud> nor </ud> should we litter. Rules often tell us what is right or wrong.','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',1,'同义辨认'),(3,' Rules can help the public make the right <cg> choices </cg> , and remain safe. Car drivers have to obey traffic <ua> regulations </ua> that tell them the <ub> right things </ub> to do on the road to avoid <uc> crashes </uc>. Cyclists who give <ud> signals </ud> before turning or stopping help prevent accidents.','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',2,'同义辨认'),(4,'Rules can help the public make the right choices, and remain safe. Car drivers have to obey <ua> traffic regulations </ua> that tell them the <ub> right things </ub> to do on the road to avoid <uc> crashes </uc> . Cyclists who give <ud> signals </ud> before turning or stopping help prevent <cg> accidents </cg> .','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',4,'同义辨认'),(5,'If people follow rules <ua> without taking other matters into consideration </ua> , it will be <cg> easy </cg> for them <ub> to form what is sometimes called a “black and white” view </ub> . For example, they may believe that <uc> people should always tell the truth </uc> , and that lying is never acceptable. Such people always stick to their views, even if it means that they may get into trouble. <ud> Sometimes it may not be so easy to know </ud> exactly what is right or wrong.','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',8,'平行结构同义辨认'),(6,'If people <ua> follow </ua> rules without taking other matters into consideration, it will be easy for them to <ub> form </ub> what is sometimes called a “black and white” view. For example, they may believe that people should <uc> always </uc> tell the truth, and that lying is <cg> never </cg> acceptable. Such people always <ud> stick to </ud> their views, even if it means that they may get into trouble.','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',4,'反义辨认'),(7,'If people follow rules without taking other matters into <ua> consideration </ua>, it will be easy for them to form what is sometimes called a <ub> “black and white” view </ub> . For example, they may believe that people should always tell the <uc> truth </uc> , and that lying is never acceptable. Such people always stick to their views, <ud> even if </ud> it means that they may get into <cg> trouble </cg> .','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',8,'假设条件下意思搭配'),(8,'Sometimes it may not be so easy to know<cg> exactly </cg>what is right or wrong.<ua> Some people choose not to eat meat</ua> because they believe that it is cruel to eat animals,<ub> but others argue that they can eat meat</ub> and still be kind to animals; <uc> some insist that stealing is always wrong</uc>, <ud> but others think that one does not need to feel so guilty</ud> when stealing some food to eat, if lives in a really poor area and he is starving.','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',15,'段落结构概括'),(9,'Sometimes it may not be so easy to know exactly what is right or wrong. Some people choose not to eat meat because they believe that it is <cg>cruel</cg> to eat animals, but others argue that they can eat meat and still be <ua> kind</ua> to animals; some insist that stealing is always <ub> wrong</ub>, but others think that one does not need to feel so guilty when <uc> stealing</uc> some food to eat, if lives in a really <ud> poor</ud> area and he is starving.','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',1,'反义辨认'),(10,'Sometimes it may not be so easy to know exactly what is right or wrong. Some people <ua> choose not to eat meat</ua> because they believe that it is <ub> cruel to eat animals</ub>, but others argue that <uc> they can eat meat</uc> and <cg>still</cg> <ud>be kind to animals</ud>; some insist that stealing is always wrong, but others think that one does not need to feel so guilty when stealing some food to eat, if lives in a really poor area and he is starving.','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',12,'表示让步意思的副词(=even so)'),(11,'Sometimes it may not be so easy to know exactly what is right or wrong. Some people choose not to eat meat because they believe that it is cruel to eat animals, but others argue that they can eat meat and still be kind to animals; some insist that stealing is always <ua> wrong</ua>, but others think that <ub> one does not need to feel</ub> so <cg>guilty</cg> when <uc> stealing</uc> some food to eat, if lives in a really <ud> poor</ud> area and he is starving.','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',6,'意思搭配'),(12,'Sometimes it may not be so easy to know exactly what is right or wrong. Some people choose not to eat meat because they believe that it is cruel to eat animals, but others argue that they can eat meat and still be kind to animals; some insist that stealing is always wrong, but others think that <ua> one does not need to feel so guilty</ua> when <ub> stealing some food to eat</ub>, if <uc> lives in a really poor area</uc> <ud> and</ud> he is <cg>starving</cg>.','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',12,'并列意思搭配'),(13,'Rules help us <ua> live together in harmony</ua>, <ub> because</ub> they <uc>show us the right way</uc> to <cg>treat</cg> other. However, some people argue that rules may be confusing, having observed that <ud>rules change all the time</ud>, and that some schools have some regulations and others have different ones ——so who is to decide what is right ?','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',7,'因果关系意思搭配'),(14,'<ua> Rules help us live together in harmony</ua>, because they show us the right way to treat other. <ub> However</ub>, some people argue that rules may be <cg>confusing</cg>, <uc> having observed that rules change all the time</uc>, and that <ud> some schools have some regulations and others have different ones</ud> ——so who is to decide what is right ?','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',14,'转折关系，概括性形容'),(15,'<ua> Rules help us live together in harmony</ua>, because they show us the right way to treat other. However, <ub> some people argue that rules may be confusing</ub>, having observed that (C) rules change all the time, and that some schools have some regulations and others have different ones ——<uc>so</uc> who is to <cg>decide</cg> <ud>what is right</ud> ?','请选择以下划线部分单词在文中所对应依据的选项(不定项选择)',15,'总结性意思搭配'),(16,'Mary will never <ua> forget</ua> the first time she <ub> saw</ub> him. He suddenly <uc> appeared</uc> in class one day,<cg> wearing</cg> <ud> sun glasses</ud>.','请选出划线部分在文中对应依据的选项',4,'非谓语动词'),(17,'He <ua> walked</ua> in <ub> as if</ub> he <cg>had bought</cg> the school, and the word quickly <uc> got around</uc> that he <ud> was</ud> from New York City','请选出划线部分在文中对应依据的选项',3,'虚拟语气'),(18,'For some reason he <ua>sat</ua> beside Mary. Mary <ub>felt</ub> <cg>pleased</cg>, because there <uc>were</uc> many empty seats in the room.','请选出划线部分在文中对应依据的选项',2,'系动词+表语（形容词）'),(19,'Dear Editor,<br>I am a secondary school teacher of English. <cy>I would like to</cy> <ua>have pen friends all over the world for my students.</ua> <ub>They are aged 15-19 and good at swimming, cycling and raising cats and dogs</ub>. <uc>If students in your country are interested in corresponding with Turkish students in English</uc>, please tell them to write to my address, so that I can distribute their letters to my students who are willing to have friends and are in need of practice. <br> Ms. Imbat <br> 8','Hobbies: swimming, cycling and raising cats and dogs <br> <cy>Purpose</cy>: <cg>finding pen friends all over the world and communicating in English</cg>',5,NULL),(20,'Dear Editor, <br><ua><cy> I am interested in </cy> corresponding with other TEFL teachers and researchers about issues of professional development.</ua> <ub><cy>I would like to </cy> share ideas with fellow teachers from English-speaking countries throughout the world.</ub> <cb>My hobbies are reading, listening to music and watching birds</cb>. <uc>Since I live in a rather isolated area, I would appreciate any spare copies of textbooks, teaching materials or journals that other teachers would be able to send me.</uc>','<cb>Hobbies: reading, listening to music and watching birds</cb><br><cy>Purpose</cy>: <cg>asking for spare copies of textbooks, teaching materials or journals</cg>',4,'快速辨认信函中的表达purpose和hobbies的信息<br>表达purpose的句子表达方式有: “I would like to have/make/know/share…, I am interested in…, I’d happy to…, I wish to…, I would appreciate…”'),(21,'Television sport programs on weekend afternoons bring more money to the television networks. <br><ua>Sports account for a growing amount of income made on the sales of commercial time by television companies.</ua> <ub>Many television companies have used sports to attract viewers from particular sections of the general public</ub>, and then <uc>they have sold audiences to advertisers.</uc>','请选择能正确表达或概括所给出句子的选项 （不定项选择）',5,'同义转述，因果顺序---果因顺序'),(22,'Weekend afternoons would become dead time without sport programs because there would be few viewers.<br><ua>An attraction of sport programs for the major U.S. media companies is that events are often held on Saturday and Sunday afternoons—the slowest time periods of the week for general television viewing.</ua><ub> Sport events are the most popular weekend programs, especially among male viewers who may not watch much television at other times during the week.</ub><uc>This means the television networks are able to sell advertising time at relatively high prices during what normally would be dead time for programming.</uc>','请选择能正确表达或概括所给出句子的选项 （不定项选择）',1,'同义转述，因果关系'),(23,'In many families, men make decisions on expensive purchases.<br><ua>Media corporations also use sports to attract commercial sponsors that might take their advertising dollars elsewhere if television stations did not report certain sports.</ua> <ub>The people in the advertising departments of major corporations realize that sports attract male viewers.</ub> <uc>They also realize that most business travelers are men and that many men make family decisions on the purchases of computers, cars and life insurance.</uc>','请选择能正确表达或概括所给出句子的选项 （不定项选择）',4,'细节归纳（词汇）'),(24,'The ratings are not important for golf and tennis programs because their advertisers target at rich people.<br>Golf and tennis are special cases for television programming. These sports attract few viewers, and the ratings(收视率)are unusually low.<ua> However, the audience for these sports is attractive to certain advertisers. It is made up of people from the highest income groups in the United States, including many lawyers and business managers.</ua> <ub>This is why television reporting of golf and tennis is sponsored by companies selling high-priced cars, business and personal computers, and holiday trips. This is also why the networks continue to carry these programs regardless of low ratings.</ub> <uc>Advertisers are willing to pay high fees to reach high-income consumers and those managers who make decisions to buy thousands of “company cars” and computers.</uc> With such viewers, these programs don’t need high ratings to stay on the air.','请选择能正确表达或概括所给出句子的选项 （不定项选择）',5,'因果关系，细节归纳（句子）'),(25,'Sports are gaining importance in advertising on television.<br><ua>Sports account for a growing amount of income made on the sales of commercial time by television companies.</ua> Many television companies have used sports to attract viewers from particular sections of the general public, and then they have sold audiences to advertisers.<br> An attraction of sport programs for the major U.S. media companies is that events are often held on Saturday and Sunday afternoons—the slowest time periods of the week for general television viewing. <ub>Sport events are the most popular weekend programs, especially among male viewers who may not watch much television at other times during the week. This means the television networks are able to sell advertising time at relatively high prices during what normally would be dead time for programming.</ub><br> <uc> Media corporations also use sports to attract commercial sponsors that might take their advertising dollars elsewhere if television stations did not report certain sports.</uc> The people in the advertising departments of major corporations realize that sports attract male viewers. They also realize that most business travelers are men and that many men make family decisions on the purchases of computers, cars and life insurance.<br><ud>Golf and tennis are special cases for television programming. These sports attract few viewers, and the ratings(收视率)are unusually low. However, the audience for these sports is attractive to certain advertisers.</ud> It is made up of people from the highest income groups in the United States, including many lawyers and business managers. This is why television reporting of golf and tennis is sponsored by companies selling high-priced cars, business and personal computers, and holiday trips. This is also why the networks continue to carry these programs regardless of low ratings. Advertisers are willing to pay high fees to reach high-income consumers and those managers who make decisions to buy thousands of “company cars” and computers. With such viewers, these programs don’t need high ratings to stay on the air.','请选择能正确表达或概括所给出句子的选项 （不定项选择）',7,'文章各段落的主要意思和对文章的篇幅结构的掌握');
