INSERT INTO `sat_danci2` VALUES ('010201','. Despite ______ on taking rare tamarins from their habitat, the illegal trade in the tiny monkeys remains ______. ','commendations…obligatory','consultations…predominant','restrictions…local','penalties…illicit','prohibitions…active',NULL,NULL,NULL,NULL,'ok',1),('010202','Representing a round world on a flat surface is impossible without some ______: the Mercator projection map shows Greenland as over ten times larger that Mexico, a country in fact only slightly smaller than Greenland.','oversight','simplification','distortion','sophistication','superficiality',NULL,NULL,'ok',NULL,NULL,2),('010203','The highly publicized redesign of the car is essentially______: the exterior has been update, but the engine remains unchanged.','intuitive','cosmetic','incoherent','consequential','retroactive',NULL,'ok',NULL,NULL,NULL,3),('010204','Many of our memories are ______, escaping our consciousness just as we strain to recall a face or a name.','elusive','pervasive','unvaried','insensitive','impractical','ok',NULL,NULL,NULL,NULL,4),('010205','Although Caroline Gordon was rigorously objective in her journalistic writing, her lively and ______ private correspondence______ a delightful capacity for biting commentary on the social scene.','incisive…disguised','eloquent…derided','dispassionate…demonstrated','exuberant…minimized','entertaining…exhibited',NULL,NULL,NULL,NULL,'ok',5),('010206','An effective member of debating team must focus clearly on the ______ issue and avoid ______ arguments.','equivocal…obstreperous','designated…pertinent','comprehensive…general','principal…peripheral','subtle…significant',NULL,NULL,NULL,'ok',NULL,6),('010207','The ______ with which merchants and landowners in early-nineteenth-century Maryland and Virginia ______ Joshua Johnston\'s professional services attests to his artistic skill as a portrait painter.','avidness…sought','difference…purchased','patience…replaced','elegance…regarded','zealousness…over