 ______ of the local drinking water.','a dispersal','a purification','a contamination','an enforcement','a polarization',NULL,NULL,'ok',NULL,NULL,603),('100902','To show them how to recognize when a thunderstorm was ______ and would soon strike, Mrs. Hauser taught her sixth-grade science students to spot cumulonimbus clouds, or thunderheads.','voluble','imminent ','saturating','mercurial','perilous',NULL,'ok',NULL,NULL,NULL,604),('100903','The class thought the new student was ______: her haughty and dismissive attitude made many of her classmates angry.','opulent','conceded','arrogant ','ominous','agile',NULL,NULL,'ok',NULL,NULL,605),('100904','When Helena won the worst Dressed Award at the Halloween party, she was utterly ______, because she hadn\'t even worn costume.','attires','incompetent','obscured','mortified ','rambunctious',NULL,NULL,NULL,'ok',NULL,606),('100905','Reacting to the chemical company\'s several decades of ______ dumping industrial waste, the government has ordered a cleanup of Onondaga Lake; however, company executives counter that the ______ costs of a thorough cleanup will bankrupt them.','imprecise…fiscal','molecular…excessive','volatile…pecuniary','unconscionable…remunerative','indiscriminate…exorbitant',NULL,NULL,NULL,NULL,'ok',607),('100906','Despite mounting evidence that the researcher\'s findings were faked, the researcher himself staunchly ______such claims.','verified','repudiated ','disseminated','embellished','insinuated',NULL,'ok',NULL,NULL,NULL,608);
