INSERT INTO `sat_math2` VALUES (1,'4-1','D',NULL,NULL,NULL,'X=24*0.75=18',NULL,1,'2.代数'),(2,'4-2','A','与X互补的角对顶角与30°互余，X=180-(90-30)=120°',NULL,NULL,NULL,NULL,1,'4.几何'),(3,'4-3','C','(1,4)不符合y=x+2','(1,4)不符合y=2x','均符合y=2x+2','(1,4)不符合y=3x','(1,4)不符合y=2x+3',1,'5.函数'),(4,'4-4','D',NULL,NULL,NULL,'（80-20）/1.5*1000=40000',NULL,1,'3.应用题'),(5,'4-5','B',NULL,'三角形ABC为等腰三角形，AD=AB*cos60°=8*1/2=4',NULL,NULL,NULL,1,'4.几何'),(6,'4-6','E',NULL,NULL,NULL,NULL,'7/x=3,则x=7/3',1,'2.代数'),(7,'4-7','B',NULL,'3feet5inches+29inches=3feet5inches+2feet5inches=5feet10inches',NULL,NULL,NULL,1,'1.算数'),(8,'4-8','C','f(x)=x+1不满足f(2)=1','f(x)=x-1不满足f(2)=1','f(x)=-x+3满足条件','f(x)=-2x+5不满足f(1)=2','f(x)=2x-1不满足f(2)=1',1,'5.函数'),(9,'4-9','D',NULL,NULL,NULL,'1980中Q约为P产量的一半，符合条件',NULL,2,'3.应用题'),(10,'4-10','A','选项=9m^2','选项=6m^2','选项=6m^2','选项=6m^2','选项=6m^2',1,'1.算数'),(11,'4-11','E',NULL,NULL,NULL,NULL,'C坐标为（6,4），则a+b=10',1,'1.算数'),(12,'4-12','D',NULL,NULL,NULL,'如图所示',NULL,2,'5.函数'),(13,'4-13','D',NULL,NULL,NULL,'(x-y)^2=1，则x-y=1或-1',NULL,1,'2.代数'),(14,'4-14','A','1/3*4^2*h*л=32л，则h=6',NULL,NULL,NULL,NULL,2,'4.几何'),(15,'4-15','E',NULL,NULL,NULL,NULL,'36,4,20,12,16,14,15,14.5',2,'6.统计'),(16,'4-16','C',NULL,NULL,'80至200的数减去140绝对值均小于等于60',NULL,NULL,2,'2.代数'),(17,'4-17','B','4+5<10,不能组成三角形','r<t<s,则BC<AC<AB;8+9<10;选项符合条件','r<t<s,则BC<AC<AB，选项不符合条件','r<t<s,则BC<AC<AB，选项不符合条件','r<t<s,则BC<AC<AB，选项不符合条件',2,'4.几何'),(18,'4-18','D',NULL,NULL,'最大值与最小值剔除，中位数不变',NULL,NULL,2,'6.统计'),(19,'4-19','E',NULL,NULL,NULL,NULL,'俩函数对称轴均为直线x=5,则-b/2a=b/2=5,b=10;y=-x^2+10x+c代入（3,4）得c=-17',3,'5.函数'),(20,'4-20','C',NULL,NULL,'三个小圆直径之和=d，阴影部分上半部分周长为三个小圆周长之和的一半，即为大圆周长的一半。阴影部分周长=大圆周长=лd',NULL,NULL,3,'4.几何'),(21,'7-1','B','60/2=30,80/2=40','80/3不是整数','60/4=15,80/4=20','60/5=12,80/5=16','60/10=6,80/10=8',1,'1.算数'),(22,'7-2','B',NULL,'PQ=(-2)-(-8)=6',NULL,NULL,NULL,1,'4.几何'),(23,'7-3','E',NULL,NULL,NULL,NULL,'3X+1=1/2(6X+2)=1/2*4k=2k',1,'2.代数'),(24,'7-4','C',NULL,NULL,NULL,NULL,'第50项-第45项=（50-45）*4=20',2,'6.统计'),(25,'7-5','B',NULL,'三角形ABE全等于三角形EDA，则角AEB=角EAD，则CE=AC=24-11=13，周长=13*2+24=50',NULL,NULL,NULL,2,'4.几何'),(26,'7-6','A','X+Y+Z=3Y,则X+Z=2Y',NULL,NULL,NULL,NULL,1,'6.统计'),(27,'7-7','A','设ESTHER赚Xdollars,3X+8=M,则X=（M-8)/3',NULL,NULL,NULL,NULL,2,'3.应用题'),(28,'7-8','D',NULL,NULL,NULL,'g(x)=0时，f(x)=-4，由图可知f(5)=-4',NULL,3,'5.函数'),(29,'9-1','A','8X-5Y=8X-8X=0',NULL,NULL,NULL,NULL,1,'2.代数'),(30,'9-2','B',NULL,'d(m)=7.00+0.25m',NULL,NULL,NULL,1,'3.应用题'),(31,'9-3','D',NULL,NULL,NULL,'与X互余的角与30°互为对顶角，则X=90-30=60°',NULL,1,'4.几何'),(32,'9-4','E',NULL,NULL,NULL,NULL,'比例=（29-7）/29=22/29',1,'6.统计'),(33,'9-5','A','n=2-5=-3,n-4=-3-4=-7',NULL,NULL,NULL,NULL,1,'1.算数'),(34,'9-6','A','x+y<0+0<0',NULL,NULL,'xy>0','xy>0',1,'1.算数'),(35,'9-7','B',NULL,'速度=4.5/2.25=2miles/h，2*2.5=5miles',NULL,NULL,NULL,1,'1.算数'),(36,'9-8','B',NULL,'g(x)+2x=8+2*(-1)=6=f(x)',NULL,NULL,NULL,2,'5.函数'),(37,'9-9','A','P=2/(2+5)=2/7',NULL,NULL,NULL,NULL,1,'6.统计'),(38,'9-10','C','关系未知','AC为直角三角形斜边，AB为直角边，AC>AB','AC为直角三角形斜边，AD为直角边，AC>AD','AC为直角三角形斜边，BC为直角边，AC>BC','关系未知',2,'4.几何'),(39,'9-11','C',NULL,NULL,'绝对值最小值为0，此时X^2=Y^2；则式子最小值为2',NULL,NULL,2,'1.算数'),(40,'9-12','A','十位数为1的有12-19,8个；十位数为2的有23-29,7个……8+7+6+5+4+3+2+1=36',NULL,NULL,NULL,NULL,2,'6.统计'),(41,'9-13','C',NULL,NULL,'直线只经过三四象限，则与X轴平行，斜率为0',NULL,NULL,1,'5.函数'),(42,'9-14','D',NULL,NULL,NULL,'3/1<5/1,则只能取3加仑白颜料与3/5红颜料',NULL,2,'3.应用题'),(43,'9-15','E',NULL,NULL,NULL,NULL,'z/y=y^4=(x^2）^4=x^8',2,'2.代数'),(44,'9-16','B',NULL,'AB=AO=BO，三角形ABO为等边三角形，角AOB=60°；同弧所对圆周角为圆心角一半角BCA=1/2角AOB=30°',NULL,NULL,NULL,2,'4.几何');
