NULL,NULL,2,'代数'),(29,'9-1','C','9不是24的因子','4,16不是3的倍数，16不是24的因子','3,6,12既为3倍数，亦为24的因子','8不是3的倍数，9不是24的因子','4不是3的倍数',1,'算数'),(30,'9-2','A','1/20*10=1/2',NULL,NULL,NULL,NULL,1,'算数'),(31,'9-3','D',NULL,NULL,NULL,'x=180-43-59=78',NULL,1,'几何'),(32,'9-4','E',NULL,NULL,NULL,NULL,'如题列式',1,'应用题'),(33,'9-5','B','1-4的绝对值为3等于3','4-4的绝对值为0小于3','7-4的绝对值为3等于3','10-4的绝对值为6大于3','13-4的绝对值为9大于3',1,'代数'),(34,'9-6','D',NULL,NULL,NULL,'平均数即第二个数为63/3即21，最大的为22',NULL,1,'统计'),(35,'9-7','A','1999年约为4.5,2000年约为9，符合条件',NULL,NULL,NULL,NULL,1,'应用题'),(36,'9-8','D',NULL,NULL,NULL,'根据对称性，n=-3,k=5,n+k=2',NULL,1,'函数'),(37,'9-9','B',NULL,'纸片总数为9除以1/3，即27，27-8-9=10',NULL,NULL,NULL,1,'统计'),(38,'9-10','C',NULL,NULL,'圆P包含在园M中，则P半径小于9，直径小于18，面积小于81π',NULL,NULL,1,'几何'),(39,'9-11','C',NULL,NULL,'25只可能为5^2,则X=5，Y=3',NULL,NULL,2,'算数'),(40,'9-12','E',NULL,NULL,NULL,NULL,'（r+s)/2<(t+t)/2=t，则选项等式不可能成立',1,'统计'),(41,'9-13','E',NULL,NULL,NULL,NULL,'勾股定理得RT=8，△PQS∽△RTS,PQ/RT=PS/RS,则PS=20，PT=20-6=14',2,'几何'),(42,'9-14','A','x取最小值1/10,1/x取最大值10',NULL,NULL,NULL,NULL,1,'代数'),(43,'9-15','B',NULL,'y=2(x-1)^2+3顶点为（1,3），直线同时经过（6,3），则解析式为y=3，斜率为0',NULL,NULL,NULL,2,'函数'),(44,'9-16','C',NULL,NULL,'三角形任意两边之和大于第三边，则5-3<x<5+3，2<x<8',NULL,NULL,1,'几何');
