7','D',NULL,NULL,NULL,'S=4^2*4-π*（8/2)^2=64-16π',NULL,1,'几何'),(28,'6-8','A','直线方程为y=2/5x+12/5，故与x轴交于（-6,0），x轴截距-6',NULL,NULL,NULL,NULL,1,'函数'),(29,'8-1','C',NULL,NULL,'a=6,b=1,a+b=7',NULL,NULL,1,'代数'),(30,'8-2','C',NULL,NULL,'x=（7620-7220）/50=8',NULL,NULL,1,'函数'),(31,'8-3','B',NULL,'S为QT中点，QS=1/2QT=8;R为QS中点，RS=1/2QS=4',NULL,NULL,NULL,1,'几何'),(32,'8-4','A','x=y=z=1/10',NULL,NULL,NULL,NULL,1,'统计'),(33,'8-5','D',NULL,NULL,NULL,'小正方形面积为1，小三角形面积为1/2，数格子可得',NULL,1,'几何'),(34,'8-6','E',NULL,NULL,NULL,NULL,'人数=111*（33%+12%）≈50（thousand）',1,'应用题'),(35,'8-7','B',NULL,'b*3-2=10,b=4;a*3-2=4,a=2',NULL,NULL,NULL,1,'统计'),(36,'8-8','A','12x+1=2+（3x)+（5x+7)，x=2；故原长为12*2+1=25',NULL,NULL,NULL,NULL,1,'代数'),(37,'8-9','E',NULL,NULL,NULL,NULL,'a+b=360°-（180°-70°）=250°',1,'几何'),(38,'8-10','A','原式=x^(2n*n^2)=x^(2n^3)',NULL,NULL,NULL,NULL,1,'算数'),(39,'8-11','C',NULL,NULL,'有勾股定理得宽=√25^2-20^2=15，面积=20*15=300',NULL,NULL,1,'几何'),(40,'8-12','E','原式=6（r-t)','原式=1/6(r-t)','原式=6（r+t)(r-t)','原式=√6（√r-√t)','原式=r-t符合题意',1,'代数'),(41,'8-13','C',NULL,NULL,'经过圆心垂直于平面的上下两条半径符合条件',NULL,NULL,2,'几何'),(42,'8-14','B',NULL,'由图可得2≤x≤6时，g(x)图像位于f(x)图像上方，满足条件',NULL,NULL,NULL,1,'函数'),(43,'8-15','D',NULL,NULL,NULL,'设两班都参加的人为x，由维恩图得11+2x=10+9，解得x=4为题目答案',NULL,2,'统计'),(44,'8-16','D',NULL,NULL,NULL,'x=a/b*10^8，a<b则a/b<1；a/b>1/10。故10^7<x<10^8',NULL,2,'代数');
