INSERT INTO `sat_math5` VALUES (1,'4-1','B',NULL,'(-2)*(-6)=12',NULL,NULL,NULL,1,'函数'),(2,'4-2','A','2y为偶数，与奇数x相加为奇数',NULL,NULL,NULL,NULL,1,'算数'),(3,'4-3','D',NULL,NULL,NULL,'△AEF为△ABD面积的1/3，△,CEF为△CBD面积的1/3',NULL,2,'几何'),(4,'4-4','B',NULL,'1920的数据为最大值，与1890的数据差距最大',NULL,NULL,NULL,1,'应用题'),(5,'4-5','A','c/d=8/2=4,则c=4d',NULL,NULL,NULL,NULL,1,'代数'),(6,'4-6','D',NULL,NULL,NULL,'斜率变为3/(2a)=1/2*3/a',NULL,1,'函数'),(7,'4-7','B','25是平方数','33=4*8+1但不为平方数','37不为8的倍数加1','49是平方数','50不是8的倍数加1',2,'算数'),(8,'4-8','E',NULL,NULL,NULL,NULL,'画图可得（距离可知，左右侧未知）',3,'几何'),(9,'7-1','D',NULL,NULL,NULL,'4ak=12,ak=3',NULL,1,'代数'),(10,'7-2','C',NULL,NULL,'AD与CF均为对角线',NULL,NULL,1,'几何'),(11,'7-3','B',NULL,'n=0+2*(8-1)=14',NULL,NULL,NULL,1,'统计'),(12,'7-4','A','如图，（-1,0）位于阴影部分',NULL,NULL,NULL,NULL,1,'函数'),(13,'7-5','A','(76-13*4)/3=8，则几何错的题目为12-8=4，整张试卷错了4+3=7题',NULL,NULL,NULL,NULL,1,'算数'),(14,'7-6','E',NULL,NULL,NULL,NULL,'a=2b=2*（3c)=6c',1,'代数'),(15,'7-7','C',NULL,NULL,'设平均数为X,则X=3X,X=0。故第三个数为0',NULL,NULL,1,'代数'),(16,'7-8','E',NULL,NULL,NULL,NULL,'矩形长为2，宽为1，则周长为6',1,'函数，几何'),(17,'7-9','E',NULL,NULL,NULL,NULL,'x+3y+z=(x+2y)+(y+z)=20+10=30',2,'代数'),(18,'7-10','D',NULL,NULL,NULL,'关于X轴对称点横坐标不变，纵坐标取相反数，则为（2,-3)',NULL,1,'函数'),(19,'7-11','B',NULL,'人数=204*（1-3/17-1/34)=162',NULL,NULL,NULL,1,'算数'),(20,'7-12','C',NULL,NULL,'x^2=(20-12)^2+(20-14)^2=100,x=10',NULL,NULL,1,'几何'),(21,'7-13','B',NULL,'图像为斜率为正，与y轴交于上半部分的直线',NULL,NULL,NULL,1,'函数'),(22,'7-14','C',NULL,NULL,'直角三角形中俩锐角为40°与50°',NULL,NULL,1,'几何'),(23,'7-15','D',NULL,NULL,NULL,'a>b,a-b>0',NULL,1,'算数'),(24,'7-16','D',NULL,NULL,NULL,'360°/36°=10，则周长为10x',NULL,1,'几何'),(25,'7-17','D',NULL,NULL,NULL,'沙拉至少20为12天，其中三文治超过15为7天，则比例为7/12',NULL,2,'应用题'),(26,'7-18','A','m为原来中位数四倍，r为原来范围4倍，m=r',NULL,NULL,NULL,NULL,1,'统计'),(27,'7-19','B',NULL,'1-20%=0.8,0.8*1.25=1',NULL,NULL,NULL,1,'代数'),(28,'7-20','A','抛物线顶点为（1,2)，直线l方程为y=4x-2，则直线k斜率同样为4，故经过（r+1,s+1*4)',NULL,NULL,NULL,NULL,3,'函数'),(29,'9-1','D',NULL,NULL,NULL,'x位于集合S和集合T中，不位于集合R中',NULL,1,'算数'),(30,'9-2','B',NULL,'0.012<0.102<0.120',NULL,NULL,NULL,1,'算数'),(31,'9-3','A','x=(180-77-65)/2=19',NULL,NULL,NULL,NULL,1,'几何'),(32,'9-4','E',NULL,NULL,NULL,NULL,'f(3)=13,f(2)=8,f(3)-f(2)=5',1,'函数'),(33,'9-5','C',NULL,NULL,'人数=1200*（5%+10%+25%）=480',NULL,NULL,1,'统计'),(34,'9-6','C',NULL,NULL,'1/2*1*8=4，故q=8',NULL,NULL,1,'几何'),(35,'9-7','A','人数=540*（1-2/3）*（1-1/2)=90',NULL,NULL,NULL,NULL,1,'算数'),(36,'9-8','E',NULL,NULL,NULL,NULL,'x1=-5,x2=35/(-5)=-7,b=-(x1+x2)=12',2,'算数'),(37,'9-9','E',NULL,NULL,NULL,NULL,'总数为（15+2）*3=51，CARMEN为51-12-15=24',1,'统计'),(38,'9-10','B',NULL,'等边三角形中，半径OA=AB=10，则周长=2π*10=20π',NULL,NULL,NULL,1,'几何'),(39,'9-11','D',NULL,NULL,NULL,'a=-4,b=2，a/b有最小整数-2',NULL,2,'算数'),(40,'9-12','A','设处理了5x只鸟，则对应4x只猫，60x只狗，总共69x只动物位于200至250之间，则x=3，处理了15只鸟',NULL,NULL,NULL,NULL,2,'算数'),(41,'9-13','D',NULL,NULL,NULL,'x-y=-5,y-x=5',NULL,1,'代数'),(42,'9-14','E',NULL,NULL,NULL,NULL,'如题可列式',1,'应用题'),(43,'9-15','A','2^x*4^（2x)=2^x*2^(4x)=2^(x+4x)=2^(5x)',NULL,NULL,NULL,NULL,1,'算数'),(44,'9-16','A','πr^2*9+1/3πr^2*9=72,r=√6',NULL,NULL,NULL,NULL,2,'几何');
