INSERT INTO `sat_yufa` VALUES (1,'SAT 2009 May US-section1','Recent evidence suggests that dark energy, a mysterious repulsive force that causes the universe to expand,<u> it has </u> been present for most of the universe’s history.','it has','it had','this has','has','having','指代问题 it和recent evidence主语重复','同上 had时态有误','指代问题This不能单独作代词 主语重复问题同上','ok','Fragment  having不能充当main verbF'),(2,NULL,'One of only a few venomous mammals, the slow loris coats the fur of its young offspring with toxic <u> saliva, which it protects them </u> from predators.','saliva, which it protects them','saliva, it protects them','saliva to protect them','saliva for protecting them','saliva, they are protected','指代问题 定语从句使用有误 which和it均指代saliva','Run-on sentence','ok','词语使用搭配问题介词for使用不当 此处应体现目的','Run-on sentence 且指代问题 they代词单复数使用有误'),(3,NULL,'Nutritionists suggest that before deciding to drastically change <u> your diet, a person should consult one’s physician. </u>','your diet, a person should consult one’s physician','your diet, you should consult your physician','one’s diet, you should consult your physician','their diet, people should consult his or her physician','their diet, consult a physician','指代问题 your和 a person代词前后不一致','ok','指代问题 One’s和you代词前后不一致','指代问题 their, people, his/her代词前后单复数不一致','LP问题 逗号之后没有主语'),(4,NULL,'Biologists working to rescue the giant condor from extinction <u> uses radio telemetry and satellite signals to track </u> banded birds.','uses radio telemetry and satellite signals to track','using radio telemetry and satellite signals to track','use radio telemetry and satellite signals to track','to track, by use of radio telemetry and satellite signals,','tracking, using radio telemetry and satellite signals,','Subject-Verb Agreement问题 uses有误','Fragment 少谓语动词 using 有误','ok','Fragment 少谓语动词 to track使用有误','Fragment 少谓语动词 tracking使用有误 using伴随结构不妥'),(5,NULL,'Iron, the metal most necessary for modem industry, <u> is more often made into an alloy than used in </u> its pure form.','is more often made into an alloy than used','is more often made into an alloy than using it','is more often made into an alloy rather than use it','which is more often made into an alloy than it is used','more often made into an alloy than used','ok','比较结构问题 前后不一致 using有误','比较结构问题使用不当 more与rather than不能同时出现','Fragment 全句少谓语动词','Fragment 全句少谓语动词'),(6,NULL,'Once a popular form of entertainment in arcades, shops, and saloons across the United States, <u> collectors prize coin-operated mechanical games </u> as emblems of the nation’s past.','collectors prize coin-operated mechanical games','collectors who prize coin-operated mechanical games','coin-operated mechanical games that are prized by collectors','coin-operated mechanical games are prized by collectors','coin-operated mechanical games, prized by collectors','Fragment 全句少谓语动词','Fragment 逗号后非完整句子','Fragment，逗号后非完整句子','ok','Fragment 逗号后非完整句子 少main verb'),(7,NULL,'<u> There is speculation that the name “Wendy” was </u> the invention of J.M.Barrie, who created a character by that name for his famous play peter pan.','There is speculation that the name “Wendy” was','There is speculation saying the name “Wendy” was','They speculate saying that the name “Wendy” was','The name “Wendy,” speculated to have been','The name “Wendy” is by some speculation','ok','词语使用和搭配问题Saying使用有误 非standard written English','指代问题They指代有误','Fragment 全句少main verb','词语使用问题 by some speculation使用有误'),(8,NULL,'The paintings by the junior high students displayed more sophisticated color <u> schemes than the elementary school students. </u>','schemes than the elementary school students','schemes than did those by the elementary school students','schemes as that which the elementary school students did','schemes, and this was not like those done by the elementary school students','schemes, not like the elementary school students','比较结构问题 对象前后不一致','ok','比较结构问题句式有误 比较句式应用more…than基本结构','比较结构问题和指代问题句式有误比较句式应用more…than基本结构 前后非并列关系 且this不能单独作代词','比较