INSERT INTO `tf_danci` VALUES (1,'Most of these leaders were involved in public life as reformers, activists working for women\'s right to vote, or authors, and were not <u>representative</u> at all of the great of ordinary women.\nThe word \"representative\" is closest in meaning to which of following?','typical','satisfied','supportive','distinctive',1),(2,'In the United States, Louis Comfort Tiffany (1843-1933) was the most noted exponent of this style, producing a great variety of glass forms and surfaces, which were widely copied in their time and are highly <u>prized</u> today. \nThe word \"prized\" is closest in meaning to which of following?','valued','universal','uncommon','preserved',1),(3,'The Art Nouveau style was a major force in the decorative arts from 1895 until 1915, although its influence continued throughout the mid-1920\'s. It was eventually to be <u>overtaken</u> by a new school of thought known as Functionalism that had been present since the turn of the century.\nThe word \"overtaken\" is closest in meaning to which of following?\n','surpassed','inclined','expressed','applied',1),(4,'During most of their lives, surge glaciers behave like normal glaciers, traveling perhaps only a couple of inches per day. However, at <u>intervals</u> of 10 to 100 years, these glaciers move forward up to 100 times faster than usual.\nThe word \"intervals\" is closest in meaning to which of following?','records','speeds','distances','periods',4),(5,'The increasing water pressure under the glacier might lift it off its bed, overcoming the friction between ice and rock, thus <u>freeing</u> the glacier, which rapidly sliders downhill surge glaciers also might be influenced by the climate, volcanic heat, or earthquakes.\nThe word \"freeing\" is closest in meaning to which of following?\n','pushing','releasing','strengthening','draining',2),(6,'A flood of ice would then surge into the Southern Sea. With the continued rise in sea level, more ice would <u>plunge</u> into the ocean, causing sea levels to rise even higher, which in turn would release more ice and set in motion a vicious cycle. \nThe word \"plunge\" is closest in meaning to which of following?\n','drop','extend','melt','drift',1),(7,'Group members look to instrumental leaders to \"get things done.\" Expressive leadership, on the other hand, is leadership that emphasizes the <u>collective</u> well-being of a social group\'s members.\nThe word \"collective\" is closest in meaning to which of following?\n','necessary','typical','group','particular',3),(8,'They offer sympathy when someone experiences difficulties or is subjected to discipline, are quick to lighten a serious moment with humor, and try to <u>resolve</u> issues that threaten to divide the group.\nThe word \"resolve\" is closest in meaning to which of following?','avoid repeating','talk about','avoid thinking about','find a solution for',4),(9,'Thousands of tons were extracted before 1875, when it was first <u>noticed</u> that the tar contained fossil remains. Major excavations were undertaken that established the significance of this remarkable site.\nThe word \"noticed\" is closest in meaning to which of following?\n','predicted','announced','corrected','observed',4),(10,'Since then, over 100 tons of fossils, 1.5 million from vertebrates, 2.5 million from invertebrates, have been recovered, often in densely concentrated <u>tangled</u> masses. \nThe word \"tangled\" is closest in meaning to which of following?\n','buried beneath','twisted together','quickly formed','easily dated',2),(11,'The asphalt at La Brea seeps to the surface, especially in the summer, and forms shallow puddles that would often have been <u>concealed</u> by leaves and dust.\nThe word \"concealed\" is closest in meaning to which of following?\n','highlighted','covered','transformed','contaminated',2),(12,'The ocean bottom --- a region nearly 2. 5 times greater than the total land area of the Earth --- is a vast frontier that even today is largely unexplored and uncharted, until about a century ago, the deep-ocean floor was completely <u>inaccessible</u>, hidden beneath waters averaging over 3,600 meters deep.The word \"inaccessible\" is closest in meaning to which of following?','unrecognizable','unreachable','unusable','unsafe',2),(13,'The DSDP\'s drill ship, the Glomar Challenger, was able to maintain a steady position on the ocean\'s surface and drill in very deep waters, <u>extracting</u> samples of sediments and rock from the ocean floor.\nThe word \"extracting\" is closest in meaning to which of following?','breaking','locating','removing','analyzing',3),(14,'Today, largely on the <u>strength</u> of evidence gathered during the Glomar Challenger\'s voyages, nearly all earth scientists agree on the theories of plate tectonics and continental drift that explain many of the geological processes that shape the Earth.\nThe word \"strength\" is closest in meaning to which of following?','basis','purpose','discovery','endurance',1),(15,'For every three Canadians in 1945, there were over five in 1966. In September 1966 Canada\'s population passed the 20 million mark. Most of this <u>surging</u> growth came from natural increase. \nThe word \"surging\" is closest in meaning to which of following?','new','extra','accelerating','surprising',3),(16,'When the prairies were being settled, undoubtedly, the good economic conditions of the 1950\'s supported a growth in the population, but the expansion also derived from a <u>trend</u> toward earlier marriages and an increase in the average size of families. The word \"trend\" is closest in meaning to which of following?','tendency','aim','growth','directive',1),(17,'After the <u>peak</u> year of 1957, the birth rate in Canada began to decline. It continued falling until in 1966, it stood at the lowest level in 25 years.\nThe word \"peak\" is closest in meaning to which of following?','pointed','dismal','mountain','maximum',4),(18,'Although the growth in Canada\'s population had slowed down by 1966 (the increase the first half of the 1960\'s was only nine percent) , another large population wave was coming over the horizon. It would be composed of the children who were born during the period of the high birth rate <u>prior to</u> 1957.\nThe phrase \"prior to\" is closest in meaning to which of following?','behind','since','during','preceding',4),(19,'<u>Advocates</u> of organic foods --- a term whose meaning varies greatly --- frequently proclaim that such products are safer and more nutritious than others.\nThe word \"Advocates\" is closest in meaning to which of following?','Proponents','Merchants','Inspectors','Consumers',1),(20,'There are numerous <u>unsubstantiated</u> reports that natural vitamins are superior to synthetic ones, that fertilized eggs are nutritionally superior to unfertilized eggs, that untreated grains are better than fumigated grains, and the like.The word \"unsubstantiated\" is closest in meaning to which of following?','unbelievable','uncontested','unpopular','unverified',4),(21,'But in many cases consumers are misled if they believe organic foods can <u>maintain</u> health and provide better nutritional quality than conventionally grown foods. So there is real cause for concern if consumers, particularly those with limited incomes, distrust the regular food supply and buy only expensive organic foods instead.\nThe word \"maintain\" is closest in meaning to which of following?','improve','monitor','preserve','restore',3),(22,'In addition, there were performers and since <u>considerable</u> importance was attached to avoiding mistakes in the enactment of rites, religious leaders usually assumed that task.\nThe word \"considerable\" is closest in meaning to which of following?','thoughtful','substantial','relational','ceremonial',2),(23,'In addition, there were performers and since considerable importance was attached to avoiding mistakes in the <u>enactment</u> of rites, religious leaders usually assumed that task.\nThe word \"enactment\" is closest in meaning to which of following?','establishment','performance','authorization','season',2),(24,'<u>Staggering</u> tasks confronted the people of the United States, North and South, when the Civil War ended. About a million and a half soldiers from both sides had to be demobilized, readjusted to civilian life, and reabsorbed by the devastated economy. The word \"Staggering\" is closest in meaning to which of following?','specialized','confusing','various','overwhelming',4),(25,'About a million and a half soldiers from both sides had to be demobilized, readjusted to civilian life, and reabsorbed by the <u>devastated</u> economy. The word \"devastated\" is closest in meaning to which of following?','developing','ruined','complicated','fragile',2),(26,'Some botanists hypothesized that the living cells of plants acted as pumps. But many experiments <u>demonstrated</u> that the stems of plants in which all the cells are killed can still move water to appreciable heights.The word \"demonstrated\" is closest in meaning to which of following?','ignored','showed','disguised','distinguished',2),(27,'As water is lost from the surface of the leaves, a negative pressure, or tension, is created. The evaporated water is replaced by water moving from inside the plant in unbroken columns that <u>extend</u> from the top of a plant to its roots. The same forces that create surface tension in any sample of water are responsible for the maintenance of these unbroken columns of water.The word \"extend\" is closest in meaning to which of following?','stretch','branch','increase','rotate',1),(28,'By opening <u>vast</u> areas of unoccupied land for residential expansion, the omnibuses, horse railways, commuter trains, and electric trolleys pulled settled regions outward two to four times more distant from city centers than they were in the premodern era.The word \"vast\" is closest in meaning to which of following?','large','basic','new','urban',1),(29,'The new accessibility of land around the periphery of almost every major city <u>sparked</u> an explosion of real estate development and fueled what we now know as urban sprawl. Between 1890 and 1920, for example, some 250,000 new residential lots were recorded within the borders of Chicago, most of them located in outlying areas.The word \"sparked\" is closest in meaning to which of following?','brought about','surrounded','sent out','followed',1),(30,'Anxious to take advantage of the possibilities of commuting, real estate developers added 800,000 <u>potential</u> building sites to the Chicago region in just thirty years-lots that could have housed five to six million people.The word \"potential\" is closest in meaning to which of following?','certain','popular','improved','possible',4),(31,'The quality of preservation is <u>outstanding</u>, but what is even more impressive is the number of ichthyosaur fossils containing preserved embryos.The word \"outstanding\" is closest in meaning to which of following?','extensive','surprising','vertical','excellent',4),(32,'Ichthyosaurs with embryos have been reported from 6 different levels of the shale in a small area around Holzamden, suggesting that a specific <u>site</u> was used by large numbers of ichthyosaurs repeatedly over time.The word \"site\" is closest in meaning to which of following?','example','location','development','characteristic',2),(33,'The quality of preservation is almost unmatched, and quarry operations have been carried out carefully with an awareness of the value of the fossils. But these factors do not <u>account for</u> the interesting question of how there came to be such a concentration of pregnant ichthyosaurs in a particular place very close to their time of giving birth.The phrase \"account for \" is closest in meaning to which of following?','record','describe','equal','explain',4),(34,'In the seventeenth century the organ, the clavichord, and the harpsichord became the chief instruments of the keyboard group, <u>a supremacy</u> they maintained until the piano supplanted them at the end of the eighteenth century.The words \"a supremacy\" in line 9 are closest in meaning to','a suggestion','an improvement','a dominance','a development',3),(35,'A series of mechanical improvements continuing well into the nineteenth century, including the introduction of pedals to sustain tone or to soften it, the perfection of a metal frame, and steel wire of the finest quality, finally produced an instrument capable of <u>myriad</u> tonal effects from the most delicate harmonies to an almost orchestral fullness of sound, from a liquid, singing tone to a ship, percussive brilliance.The word \"myriad\" is closest in meaning to which of following?','noticeable','many','loud','unusual',2),(36,'Each one was virtually a stone town, which is why the Spanish would later call them pueblos, the Spanish word for towns. These pueblos represent one of the Anasazis\' <u>supreme</u> achievements. At least a dozen large stone houses took shape below the bluffs of Chiaco Canyon in northwest New Mexico.The word \"supreme\" is closest in meaning to which of following?','most common','most outstanding','most expensive','most convenient',2),(37,'They functioned as sanctuaries where the elders met to plan festivals, perform ritual dances, <u>settle</u> pueblo affairs, and impart tribal lore to the younger generation.The word \"settle\" is closest in meaning to which of following?','sink','decide','clarify','locate',3),(38,'Then, to connect the pueblos and to give access to the surrounding tableland, the architects laid out a system of public roads with stone staircases for <u>ascending</u> cliff faces.The word \"ascending\" is closest in meaning to which of following?','arriving at','carving','connecting','climbing',4),(39,'Within a very short time, however, the incongruity of playing lively music to a <u>solemn</u> film became apparent, and film pianists began to take some care in matching their pieces to the mood of the film.The word \"solemn\" is closest in meaning to which of following?','simple','serious','short','silent',2),(40,'Certain films had music especially <u>composed</u> for them. The most famous of these early special scores was that composed and arranged for D. W. Griffith\'s film Birth of a Nation, which was released in 1915.The word \"composed\" is closest in meaning to which of following?','selected','combined','played','created',4),(41,'Certain films had music especially composed for them. The most famous of these early special <u>scores</u> was that composed and arranged for D. W. Griffith\'s film Birth of a Nation, which was released in 1915.The word \"scores\" is closest in meaning to which of following?','totals','successes','musical compositions','groups of musicians',3),(42,'The Earth <u>comprises</u> three principal layers: the dense, iron-rich core, the mantle made of silicate rocks that are semimolten at depth, and the thin, solid-surface crust.The word \"comprises\" is closest in meaning to which of following?','adapts to','benefits from','consists of','focuses on',3),(43,'These plates move over the semimolten lower mantle to produce all of the major topographical features of the Earth. Active zones where <u>intense</u> deformation occurs are confined to the narrow, interconnecting boundaries of contact of the plates.The word \"intense\" is closest in meaning to which of following?','surface','sudden','rare','extreme',4),(44,'New oceanic crust is formed along one or more <u>margins</u> of each plate by material issuing from deeper layers of the Earth\'s crust, for example, by volcanic eruptions of lava at midocean ridges.The word \"margins\" is closest in meaning to which of following?','edges','peaks','interiors','distances',1),(45,'If at such a spreading contact the two plates <u>support</u> continents, a rift is formed that will gradually widen and become flooded by the sea. The Atlantic Ocean formed like this as the American and Afro-European plates move in opposite directions.The word \"support\" is closest in meaning to which of following?','separate','create','reduce','hold',4),(46,'Coincident with concerns about the accelerating loss of species and habitats has been a growing <u>appreciation</u> of the importance of biological diversity, the number of species in a particular ecosystem, to the health of the Earth and human well-being.The word \"appreciation\" is closest in meaning to which of following?','ignorance','recognition','tolerance','forgiveness',2),(47,'An alien exploring Earth would probably give priority to the planet\'s dominant, most-distinctive feature-the ocean. Humans have a <u>bias</u> toward land that sometimes gets in the way of truly examining global issues.The word \"bias\" is closest in meaning to which of following?','concern','disadvantage','attitude','prejudice',4),(48,'The <u>prevailing</u> winds in the Great Basin are from the west. Warm, moist air from the Pacific Ocean is forced upward as it crosses the Sierra Nevada.The word \"prevailing\" is closest in meaning to which of following?','most frequent','occasional','gentle','most dangerous',1),(49,'There seem to have been several periods within the last tens of thousands of years when water <u>accumulated</u> in these basins. The rise and fall of the lakes were undoubtedly linked to the advances and retreats of the great ice sheets that covered much of the northern part of the North American continent during those times.The word \"accumulated\" is closest in meaning to which of following?','dried','flooded','collected','evaporated',3),(50,'All living creature, especially human beings, have their peculiarities, but everything about the little sea cucumber seems unusual. What else can be said about a <u>bizarre</u> animal that, among other eccentricities, eats mud, feeds almost continuously day and night but can live without eating for long periods, and can be poisonous but is considered supremely edible by gourmets? The phrase \"bizarre\" is closest in meaning to which of following?','odd','marine','simple','rare',1),(51,'Its major enemies are fish and crabs, when attacked, it squirts all its internal organs into the water. It also <u>casts off</u> attached structures such as tentacles. The sea cucumber will eviscerate and regenerate itself if it is attacked or even touched; it will do the same if the surrounding water temperature is too high or if the water becomes too polluted.The phrase \"casts off\" is closest in meaning to which of following?','grows again','grabs','gets rid of','uses as a weapon',3),(52,'A folk culture is small, isolated, cohesive, conservative, nearly self-sufficient group that is <u>homogeneous</u> in custom and race, with a strong family or clan structure and highly developed rituals.The word \"homogeneous\" is closest in meaning to which of following?','uniform','general','primitive','traditional',1),(53,'Unaltered folk cultures no longer exist in industrialized countries such as the United States and Canada. Perhaps the nearest modern equivalent in Anglo-America is the Amish, a German American farming sect that <u>largely renounces</u> the products and labor saving devices of the industrial age.The phrase \"largely renounces\" is closest in meaning to which of following?','generally rejects','greatly modifies','loudly declares','often criticizes',1),(54,'Secular institutions, of control such as the police and army take the place of religion and family in maintaining order, and a money-based economy <u>prevails</u>. Because of these contrasts, \"popular\" may be viewed as clearly different from \"folk\".The word \"prevails\" is closest in meaning to which of following?','dominates','provides','develops','invests',1),(55,'Conventional computer models of the atmosphere have limited value in predicting short-lived local storms like the Edmonton tornado, because the available weather data are generally not detailed enough to allow computers to discern the <u>subtle</u> atmospheric changes that precede these storms.The word \"subtle\" is closest in meaning to which of following?','complex','regular','imagined','slight',4),(56,'Communications satellites can transmit data around the world cheaply and instantaneously, and modern computers can quickly <u>compile</u> and analyzing this large volume of weather information.The word \"compile\" is closest in meaning to which of following?','put together','look up','pile high','work over',1),(57,'Meteorologists and computer scientists now work together to design computer programs and video equipment capable of transforming <u>raw</u> weather data into words, symbols, and vivid graphic displays that forecasters can interpret easily and quickly.The word \"raw\" is closest in meaning to which of following?','stormy','inaccurate','uncooked','unprocessed',4),(58,'People in the United States in the nineteenth century were haunted by the <u>prospect</u> that unprecedented change in the nation\'s economy would bring social chaos.The word \"Prospect\" is closest in meaning to which of following?','regret','possibility','theory','circumstance',2),(59,'Although the birth rate continued to decline from its high level of the eighteenth and early nineteenth century, the population <u>roughly</u> doubled every generation during the rest of the nineteenth centuries. As the population grew, its makeup also changed.The word \"roughly\" is closest in meaning to which of following?','harshly','surprisingly','slowly','approximately',4),(60,'Rapid industrialization and increased geographic mobility in the nineteenth century had special implications for women because these changes tended to <u>magnify</u> social distinctions. As the roles men and women played in society became more rigidly defined, so did the roles they played in the home.The word \"magnify\" is closest in meaning to which of following?','solve','explain','analyze','increase',4),(61,'Rapid industrialization and increased geographic mobility in the nineteenth century had special implications for women because these changes tended to magnify social <u>distinctions</u>. As the roles men and women played in society became more rigidly defined, so did the roles they played in the home.The word \"distinctions\" is closest in meaning to which of following?','differences','classes','accomplishments','characteristics',1),(62,'In science, a theory is a reasonable explanation of observed events that are <u>related</u>. A theory often involves an imaginary model that helps scientists picture the way an observed event could be produced.The word \"related\" is closest in meaning to which of following?','connected','described','completed','identified',1),(63,'If observations confirm the scientists\' predictions, the theory is <u>supported</u>.The word \"supported\" is closest in meaning to which of following?','finished','adjusted','investigated','upheld',4),(64,'The ice trade grew with the growth of cities. Ice was used in hotels, taverns, and hospitals, and by some <u>forward-looking</u> city dealers in fresh meat, fresh fish, and butter.The phrase \"forward-looking\" is closest in meaning to which of following?','progressive','popular','thrifty','well-established',1),(65,'Making an efficient icebox was not as easy as we might now suppose. In the early nineteenth century, the knowledge of the physics of heat, which was essential to a science of refrigeration, was <u>rudimentary</u>. The word \"rudimentary\" is closest in meaning to which of following?','growing','undeveloped','necessary','uninteresting',2),(66,'Aside from perpetuating itself, the <u>sole</u> purpose of the American Academy and Institute of Arts and Letters is to \"foster, assist and sustain an interest\" in literature, music, and art.The word \"sole\" is closest in meaning to which of following?','only','honorable','common','official',1),(67,'One award <u>subsidizes</u> a promising American writer\'s visit to Rome. There is even an award for a very good work of fiction that failed commercially-once won by the young John Updike for The Poorhouse Fair and, more recently, by Alice Walker for In Love and Trouble.The word \"subsidizes\" is closest in meaning to which of following?','assures','finances','schedules','publishes',2),(68,'Committee membership <u>rotates</u> every year, so that new voices and opinions are constantly heard.The word \"rotates\" is closest in meaning to which of following?','alternates','participates','decides','meets',1),(69,'One important line of evidence comes from flaking patterns of stone cores used in tool making: <u>implements</u> flaked with a clockwise motion (indicating a right-handed toolmaker) can be distinguished from hose flaked with a counter-clockwise rotation (indicating a left-handed toolmaker) .The word \"implements\" is closest in meaning to which of following?','tools','designs','examples','pieces',1),(70,'Even scratches found on fossil human teeth offer <u>clues</u>. Ancient humans are thought to have cut meat into strips by holding it between their teeth and slicing it with stone knives, as do the present-day Inuit.The word \"clues\" is closest in meaning to which of following?','solutions','details','damage','information',4),(71,'The variation between the <u>hemispheres</u> corresponds to which side of the body is used to perform specific activities. Such studies, as well as studies of tool use, indicate that right-or left-sided dominance is not exclusive to modern Homo sapiens.The word \"hemispheres\" is closest in meaning to which of following?','differences','sides','activities','studies',2),(72,'Plants are <u>subject to</u> attack and infection by a remarkable variety of symbiotic species and have evolved a diverse array of mechanisms designed to frustrate the potential colonists.The phrase \"subject to\" is closest in meaning to which of following?','susceptible to','classified by','attractive to','strengthened by',1),(73,'The external surfaces of plants, in addition to being covered by an epidermis and a waxy cuticle, often carry spiky hairs known as trichomes, which either prevent feeding by insects or may even <u>puncture</u> and kill insect larvae.The word \"puncture\" is closest in meaning to which of following?','pierce','pinch','surround','cover',1),(74,'Orchids are unique in having the most highly developed of all blossoms, in which the usual male and female reproductive organs are <u>fused</u> in a single structure called the column.The word \"fused\" is closest in meaning to which of following?','combined','hidden','fertilized','produced',1),(75,'To <u>lure</u> their pollinators from afar, orchids use appropriately intriguing shapes, colors, and scents. At least 50 different aromatic compounds have been analyzed in the orchid family, each blended to attract one, or at most a few, species of insects or birds.The word \"lure\" is closest in meaning to which of following?','attract','recognize','follow','help',1),(76,'Once the right insect has been attracted, some orchids present all sorts of one-way obstacle courses to make sure it does not leave until pollen has been accurately <u>placed</u> or removed.The word \"placed\" is closest in meaning to which of following?','estimated','measured','deposited','identified',3),(77,'By such ingenious adaptations to specific pollinators, orchids have avoided the hazards of rampant crossbreeding in the wild, assuring the survival of species as <u>discrete</u> identities. At the same time they have made themselves irresistible to collectors.The word \"discrete\" is closest in meaning to which of following?','complicated','separate','inoffensive','functional',2),(78,'The public school system suddenly found itself <u>overtaxed</u>. While the number of schoolchildren rose because of wartime and postwar conditions, these same conditions made the schools even less prepared to cope with the flood.The word \"overtaxed\" is closest in meaning to which of following?','well prepared','plentifully supplied','heavily burdened','charged too much',3),(79,'Therefore, in the 1950\'s and 1960\'s, the baby boom hit an antiquated and <u>inadequate</u> school system. Consequently, the \"custodial rhetoric\" of the 1930\'s and early 1940\'s no longer made sense; that is, keeping youths aged sixteen and older out of the labor market by keeping them in school could no longer be a high priority for an institution unable to find space and staff to teach younger children aged five to sixteen.The word \"inadequate\" is closest in meaning to which of following?','deficient','expanded','innovative','specialized',1),(80,'With the baby boom, the focus of educators and of laymen interested in education <u>inevitably</u> turned toward the lower grades and back to basic academic skills and discipline.The word \"inevitably\" is closest in meaning to which of following?','unwillingly','impartially','irrationally','unavoidably',4),(81,'Deeply philosophical historians such as Henry Adams <u>lamented</u> the role that the new frenzy for business was playing in eroding traditional values. A distrust of industry and business continued among writers throughout the rest of the nineteenth century and into the twentieth.The word \"lamented\" is closest in meaning to which of following?','complained about','analyzed','explained','reflected on',1),(82,'One thinks of melodramas, boys\' books, thrillers, romances, and the like rather than novels of the <u>first rank</u>.The phrase \"first rank\" is closest in meaning to which of following?','largest category','highest quality','earliest writers','most difficult language',2),(83,'These writers, who can genuinely be said to have created a genre, the \"railroad novel,\" are now mostly forgotten, their names having <u>faded from</u> memory.The words \"faded from\" in line 21 are closest in meaning to','grew in','disappeared from','remained in','developed from',2),(84,'The engine that became