ir small size and particular characteristics, but even the most favored are very isolated fragments of land, strictly <u>circumscribed</u> by the ocean, strictly limited in terms of the numbers of people they can support.The word \"circumscribed\" is closest in meaning to which of following?','located','flooded','restricted','pushed',3),(370,'Simply surviving those ocean crossings of <u>indeterminate</u> length, in open canoes, to arrive on the shores of uninhabited and hitherto unknown islands, was a formidable achievement.The word \"indeterminate\" is closest in meaning to which of following?','undecided','uncertain','unacceptable','increasing',2),(371,'The Rosetta stone <u>thwarted</u> scholars\' efforts for several decades until the early nineteenth century when several key hieroglyphic phrases were decoded using the Greek inscriptions.The word \"thwarted\" is closest in meaning to which of following?','continued','influenced','encouraged','frustrated',4),(372,'Lichens, probably the <u>hardest</u> of all plants, live where virtually nothing else can---not just on rugged mountain peaks but also on sunbaked desert rocks.The word \"hardest\" is closest in meaning to which of following?','most unusual','most basic','most abundant','most vigorous',4),(373,'Unlike other members of the plant kingdom, lichens are actually a partnership between two plants. The <u>framework</u> of a lichen is usually a network of minute hairlike fungus that anchors the plant.The word \"framework\" is closest in meaning to which of following?','structure',NULL,'condition','environment',1),(374,'When water is scarce (as is often the case on a mountain) , lichens may become dormant and remain in that condition for <u>prolonged</u> periods of time.The word \"prolonged\" is closest in meaning to which of following?','precise','extended','approximate','regular',2),(375,'For decades, scientists wondered how the offspring of an alga and a fungus got together to form a new lichen; it seemed unlikely that they would just happen to <u>encounter</u> one another.The word \"encounter\" is closest in meaning to which of following?','lose','support','meet','create',3),(376,'Newbery <u>notwithstanding</u>, Americans still looked on children\'s books as vehicles for instruction, not amusement, though they would accept a moderate amount of fictional entertainment for the sake of more successful instruction.The word \"notwithstanding\" is closest in meaning to which of following?','in spite of','in addition to','as a result of','as a part of',1),(377,'As the children\'s book market expanded, then, what both public and publishers wanted was the kind of fiction Maria Edgeworth wrote: stories interesting enough to attract children and morally instructive enough to <u>allay</u> adult distrust of fiction.The word \"allay\" is closest in meaning to which of following?','clarify','attack','reduce','confirm',3),(378,'The characters of children in this fiction were serious, conscientious, self-reflective, and independent --- strong <u>testimony</u> to the continuing influence of the earlier American moralistic tradition in children\'s books.The word\" testimony to\" is closest in meaning to which of following?','inspiration for','evidence of','requirement for','development of',2),(379,'The Moon, which has <u>undergone</u> a distinct and complex geological history presents a striking appearance.The word \"undergone\" is closest in meaning to which of following?','altered','substituted','experienced','preserved',3),(380,'It is now known that the </u>vast</u> majority of the Moon\'s craters were formed by the impact of solid bodies with the lunar surface.The word \"vast\" is closest in meaning to which of following?','special','Known','varied','great',4),(381,'The term \"latent heat\" refers to the energy that has to be used to <u>convert</u> liquid water to water vapor.The word \"convert\" is closest in meaning to which of following?','mix','change','adapt','reduce',2),(382,'In the atmosphere, a large portion of the Sun\'s incoming energy is used to evaporate water, <u>primarily</u> in the tropical oceans.The word \"primarily\" in the line 19 is closest in meaning to which of following?','chiefly','originally','basically','clearly',1),(383,'Other species may become better adapted to an environment, resulting in competition and, <u>ultimately</u>, in the death of a species.The word \"ultimately\" is closest in meaning to which of following?','exceptionally','dramatically','eventually','unfortunately',3),(384,'One of the best-known examples of mass extinction occurred 65 million years ago with the <u>demise</u> of dinosaurs and many other forms of life.The word \"demise\" is closest in meaning to which of following?','change','recovery','help','death',4),(385,'One interesting, and controversial, <u>finding</u> is that extinctions during the past 250 million years have tended to be more intense every 26 million years.The word \"finding\" is closest in meaning to which of following?','published information','research method','ongoing experiment','scientific discovery',4),(386,'Even the name is an epithet, a synonym for the stunted, the scruffy, the <u>insignificant</u>, what is beautiful about such a place?The word \"insignificant\" is closest in meaning to which of following?','unimportant','undisturbed','immature','inappropriate',1),(387,'Potter, for instance, found it convenient to locate their workshops near their source of clay, <u>regardless</u> of its relation to the center of settlement.The phrase \"regardless of\" is closest in meaning to which of following?','as a result of','no matter what','proud of','according to',2),(388,'The techniques of pottery manufacture had evolved well before the Greek period, but <u>marked</u> stylistic developments occurred in shape and in decoration, for example, in the interplay of black and other glazes with the red surface of the fired pot.The word \"marked\" is closest in meaning to which of followin