aning to which of following?','organ','activity','group','cycle',3),(395,'Fire ants also make use of an alarm pheromone to <u>alert</u> workers to an emergency, and their scouts lay down a trail pheromone as a guide during mass migrations.The word \"alert\" is closest in meaning to which of following?','allow','transport','warn','provide',3),(396,'A fire ant queen emits a chemical signal that identifies her to the colony\'s workers. They respond by <u>scurrying</u> to gather around her. The decomposing corpse of a dead ant also generates a signal, to which workers respond by eliminating the corpse from the nest.The word \"scurrying\" is closest in meaning to which of following?','agreeing','appearing','competing','rushing',4),(397,'Rivers also reveal clay along their banks, and erosion on a hillside may make clay easily <u>accessible</u>.The word \"accessible\" is closest in meaning to which of following?','buried','improved','available','workable',3),(398,'Variations of clay composition and the temperatures at which they are fired <u>account for</u> the differences in texture and appearance between a china teacup and an earthenware flowerpot.The phrase \"account for\" is closest in meaning to which of following?','reduce','explain','combine with','list all of',2),(399,'One researcher observed babies and their mothers in six <u>diverse</u> cultures and found that, in all six languages, the mothers used simplified syntax, short utterances and nonsense sounds, and transformed certain sounds into baby talk.The word \"diverse\" is closest in meaning to which of following?','surrounding','divided','different','stimulating',3),(400,'Other investigators have <u>noted</u> that when mothers talk to babies who are only a few months old, they exaggerate the pitch, loudness, and intensity of their words.The word \"noted\" is closest in meaning to which of following?','theorized','requested','disagreed','observed',4),(401,'They also exaggerate their facial expressions, hold vowels longer, and <u>emphasize</u> certain words.The word \"emphasize\" is closest in meaning to which of following?','stress','repeat','explain','leave out',1),(402,'When songs have been <u>subjected</u> to these processes, their origin is usually impossible to trace.The word \"subjected\" is closest in meaning to which of following?','reduced','modified','exposed','imitated',3),(403,'This constant reshaping and re-creation is the <u>essence</u> of folk music. Consequently, modern popular songs and other published music, even though widely sung by people who are not professional musicians, are not considered folk music.The word \"essence\" is closest in meaning to which of following?','basic nature','growing importance','full extent','first phase',1),(404,'In 1903 the members of the governing board of the University of Washington, in Seattle, <u>engaged</u> a firm of landscape architects, specialists in the design of outdoor environments --- Olmsted Brothers of Brookline, Massachusetts --- to advise them on an appropriate layout for the university grounds.The word \"engaged\" is closest in meaning to which of following?','trained','hired','described','evaluated',2),(405,'John Olmsted did the investigation and <u>subsequent</u> report on Seattle\'s parks.The word \"subsequent\" is closest in meaning to which of following?','complicated','alternate','later','detailed',3),(406,'With such unparalleled <u>sums</u> at their disposal, with the Olmsted guidelines to follow, and with the added incentive of wanting to have the city at its best for the Alaska-Yukon-Pacific Exposition of 1909, the Parks Board bought aggressively.The word \"sums\" is closest in meaning to which of following?','problems','amounts','services','debts',2),(407,'Many prehistoric people subsisted as hunters and gatherers. <u>Undoubtedly</u>, game animals, including some very large species, provided major components of human diets.The word \"Undoubtedly\" is closest in meaning to which of following?','occasionally','unexpectedly','previously','certainly ',4),(408,'Many prehistoric people subsisted as hunters and gatherers. Undoubtedly, game animals, including some very large species, provided major <u>components</u> of human diets.The word \"components\" is closest in meaning to which of following?','parts','problems','changes','varieties',NULL),(409,'Hunter-gatherers may have contributed to Pleistocene extinctions in more indirect ways. <u>Besides</u> overhunting, at least three other kinds of effects have been suggested: direct competition, imbalances between competing species of game animals, and early agricultural practices.The word \"Besides\" is closest in meaning to which of following?','caused by','whereas','in addition to','in favor of',3),(410,'If such hunters first competed with the larger predators and then replaced them, they may have allowed more young to survive each year, gradually increasing the populations of <u>favored</u> species.The word \"favored\" is closest in meaning to which of following?','large','escaping','preferred','local',3),(411,'They became an <u>integral</u> part of the gardens of the Ottoman Empire from the sixteenth century onward, and, soon after, part of European life as well.The word \"integral\" is closest in meaning to which of following?','interesting','fundamental','ornamental','overlooked',2),(412,'They <u>flourished</u> in Pennsyvania too, where in 1698 William Penn received a report of John Tateham\'s \"Great and Stately Palace,\" its garden full of tulips.The word \"flourished\" is closest in meaning to which of following?','were discovered','were marketed','combined','thrived',4),(413,'Thomas Hancock, an English settler, wrote thanking his plant supplier for a gift of some tulip bulbs from England, but his letter of the following year <u>grumbled</u> that they were all dead.The word \"grumbled\" is closest in meaning to which of following?','denied','warned','complained','explained',3),(414,'No two comets ever look <u>identical</u>, but they have basic features in common, one of the most obvious of which is a coma.The word \"identical\" is closest in meaning to which of following?','equally fast','exactly alike','near each other','invisible',2),(415,'At the <u>heart</u> of a comer\'s coma lies a nucleus of solid material, typically no more than 10 kilometers across.The word \"heart\" is closest in meaning to which of following?','center','edge','tail','beginning',1),(416,'The most <u>graphic</u> proof that the grand spectacle of a comet develops from a relatively small and inconspicuous chunk of ice and dust was the close-up image obtained in 1986 by the European Giotto probe of the nucleus of Halley\'s Comet.The word \"graphic\" is closest in meaning to which of following?','mathematical','popular','unusual','vivid',4),(417,'As a comet\'s orbit brings it closer to the Sun, first the coma grows, then two <u>distinct</u> tails usually form.The word \"distinct\" is closest in meaning to which of following?','visible','gaseous','separate','new',3),(418,'Pheromones are substances that <u>serve</u> as chemical signals between members of the same species.The word \"serve\" is closest in meaning to which of following?','improve','function','begin','rely',2),(419,'Pheromones are the predominant medium of communication among insects (but rarely the <u>sole</u> method) . Some species have simple pheromone systems and produce only a few pheromones, but others produce many with various functions.The word \"sole\" is closest in meaning to which of following?','obvious','best','only','final',3),(420,'Some species, such as ants, seem to be very articulate creatures, but their medium of communication is difficult for humans to study and appreciate because of our own olfactory insensitivity and the technological difficulties in <u>detecting</u> and analyzing there pheromones.The word \" detecting \" is closest in meaning to which of following?','controlling','storing','questioning','finding',4)