mitation','compontent',1),(427,'By far, the most <u>appealing</u> publishing investments were to be found in small books that had proven to be steady sellers, providing a reasonably reliable source of income for the publisher.The word \"appealing\" is closest in meaning to which of following?','dependable','respectable','enduring','attractive',4),(428,'Almanacs, annual publications that contained information on astronomy and weather patterns arranged according to the days, week, and months of a given year, provided the perfect steady seller because their information pertained to the <u>locale</u> in which they would be used.The word \"locale\" is closest in meaning to which of following?','topic','season','interest','place',4),(429,'What unusual or <u>unique</u> biological train led to the remarkable diversification and unchallenged success of the ants for over 50 million years?The word \"unique\" is closest in meaning to which of following?','inherited','habitual','singular','natural',3),(430,'The answer appears to be that they were the first group of predatory ensocial insects that both lived and foraged primarily in the soil and in <u>rotting</u> vegetation on the ground.The word \"rotting\" is closest in meaning to which of following?','decaying','collected','expanding','cultivated',1),(431,'Richly organized colonies of the kind made possible by eusociality enjoy several <u>key</u> advantages over solitary individuals.The word \"key\" is closest in meaning to which of following?','uncommon','important','incidental','temporary',2),(432,'Composers today use a <u>wider</u> variety of sounds than ever before, including many that were once considered undesirable noises.The word \"wider\" is closest in meaning to which of following?','more impressive','more distinctive','more controversial','more extensive',4),(433,'Non-Western music typically divides and interval between two pitches more finely than Western music does, <u>thereby</u> producing a greater number of distinct tones, or microtones, within the same interval.The word \"thereby\" is closest in meaning to which of following?','in return for','in spite of','by the way','by that means',4),(434,'The population of Los Angeles (114,000 in 1900) rose spectacularly in the early decades of the twentieth century, increasing a dramatic 1,400 percent from 1900 to 1930. A number of circumstances contributed to the <u>meteoric</u> rise of Los Angeles.The word \"meteoric\" is closest in meaning to which of following?','rapid','famous','controversial','methodical',1),(435,'The downtown business district did not grow <u>apace with</u> the city as a whole, and the rapid transit system designed to link the center with outlying areas withered away from disuse.The phrase \"apace with\" is closest in meaning to which of following?','anew with','apart from','as fast as','at the middle of',3),(436,'After the 1870\'s, a number of important authors began to reject the romanticism that had <u>prevailed</u> immediately following the Civil War of 1861-1865 and turned instead to realism.The word \"prevailed\" is closest in meaning to which of following?','dominated','transformed','entered','generalized',1),(437,'Realists such as Joel Chandler Harris and Ellen Glasgow <u>depicted</u> life in the South; Hamlin garland described life on the Great Plains; and Sarah Orne Jewett wrote about everyday life in rural New England.The word \"depicted\" in line11 is closest in meaning to which of following?','emphasized','described','criticized','classified',2),(438,'Theodore Dreiser, the <u>foremost</u> naturalist writer, in novels such as Sister Carrie, grimly portrayed a dark world in which human beings were tossed about by forces beyond their understanding or control.The word \"foremost\" is closest in meaning to which of following?','most difficult','interesting','most focused','leading',4),(439,'Even in this current era of large scale, <u>intensive</u> research and development, the interrelationships involved in this process are frequently misunderstood.The word \"intensive\" is closest in meaning to which of following?.','decreased','concentrated','creative','advanced',2),(440,'The widespread and usually uncritical acceptance of this thesis led in turn to the <u>assumption</u> that application of science to industrial purposes was a linear process, starting with fundamental science, then proceeding to applied science or technology, and through them to industrial use.The word \"assumption\" is closest in meaning to which of following?','understanding','public awareness','scientific knowledge','expansion',1),(441,'The most thoroughly studied cases of deception strategies employed by ground-nesting birds involve plovers, small birds that typically nest on beaches or in open fields, their nests <u>merely</u> scrapes in the earth.The word \"merely\" is closest in meaning to which of following?','often','only','usually','at first',2),(442,'One technique involves first moving quietly toward an approaching animal and then setting off noisily through the grass or brush in a low, crouching run away from the nest, while <u>emitting</u> rodentlike squeaks.The word \"emitting\" is closest in meaning to which of following?','bringing','attracting','producing','minimizing',3),(443,'The plover\'s most famous stratagem is the broken --- wing display, actually a continuum of injury --- mimicking behaviors <u>spanning</u> the range from slight disability to near -complete helplessness.The word \"spanning\" is closest in meaning to which of following?','covering','selecting','developing','explaining',1),(444,'Few predators fail to <u>pursue</u> such obviously vulnerable prey. Needless to say, each short run between \"flight attempts\" is directed away from the nest.The word \"pursue\" is closest in meaning to which of following?','catch','notice','defend','chase',4),(445,'Glass fibers were little more than a novelty until the 1930\'s, when their thermal and electrical insulating properties were <u>appreciated</u> and methods for producing continuous filaments were developed.The word \"appreciated\" is closest in meaning to which of following?','experienced','recognized','explored','increased',2),(446,'The <u>scarce</u> fossils of the Proterozoic, mostly single-celled bacteria, provide little evidence in this regard. However, the rocks themselves do include the earliest evidence for glaciation, probably a global ice age.The word \"scarce\" is closest in meaning to which of following?','ancient','tiny','available','rare',4),(447,'In 2.3-billion-year-old rocks in Canada near Lake Huron (dating from the early part of the Proterozoic age), there are thin laminae of fine-grained sediments that <u>resemble</u> varves, the annual layers of sediment deposited in glacial lakes.The word \"resemble\" is closest in meaning to which of following?','result from','penetrate','look like','replace',3),(448,'Watching the behaviors <u>diverse</u> animal species in their natural habitats, Lorenz, and Tinbergen observed behavior patterns that promote survival.The word \"diverse\" is closest in meaning to which of following?','small','varied','wild','particular',2),(449,'The most well-known of these is imprinting, the early following behavior of certain baby birds that <u>ensures</u> that the young will stay close to their mother and be fed and protected from danger.The word \"ensures\" is closest in meaning to which of following?','guarantees','proves','teaches','assumes',1),(450,'It refers to a limited time span during which the child is biologically prepared to acquire certain adaptive behaviors but needs the support of <u>suitably</u> stimulating environment.The word \"suitably\" is closest in meaning to which of following?','willingly','moderately','appropriately','emotionally',3),(451,'The development of attachment in human infants is a lengthy process involving changes in psychological structures that lead to a deep <u>affectional tie</u> between parent and baby.The phrase \"affectional tie\" is closest in meaning to which of following?','cognitive development','emotional attachment','psychological need','behavioral change',2),(452,'Locke strongly suggested that individuals, while accepting their Americanism, take pride in their African ancestral arts and <u>urged</u> artists to look to Africa for substance and inspiration.The word \"urged\" is closest in meaning to which of following?','prepared','defined','permitted','encouraged',4),(453,'From this unity created by the <u>convergence</u> of artists from various social and geographical backgrounds came a new spirit, which, particularly in densely populated Harlem, was to result in greater group awareness and self-determination.The word \"convergence\" is closest in meaning to which of following?','gathering','promotion','expression','influence',1),(454,'African American graphic artists took their place beside the poets and writers of the Harlem Renaissance and <u>carried on</u> efforts to increase and promote the visual arts.The phrase \"carried on\" is closest in meaning to which of following?','continued','praised','transformed','connected',1);
