alities</uc> rather than for their <uc>religious usefulness</uc>.',1,1,1),(11,'S','<ua>The structure of the backbone</ua> shows, however, that <ub>Ambulocetus</ub> swam like <uc>modern whales</uc> by moving the rear portion of its body up and down, even though a fluke was missing.',1,NULL,NULL),(12,'V','The structure of the backbone <ua>shows</ua>, however, that Ambulocetus <ub>swam</ub> like modern whales by <uc>moving</uc> the rear portion of its body up and down, even though a fluke was missing.',1,NULL,NULL),(13,'O','The structure of the backbone shows, however, that <ua>Ambulocetus</ua> swam like <ub>modern whales</ub> by moving the <uc>rear portion of its body</uc> up and down, even though a fluke was missing.',1,1,1),(14,'S','The extreme <ua>seriousness</ua> of desertification results from the vast <ub>areas</ub> of land and the tremendous <uc>numbers of people</uc> affected, as well as from the great difficulty of reversing or even slowing the process.',1,NULL,NULL),(15,'V','The extreme seriousness of desertification <ua>results from</ua> the vast areas of land and the tremendous numbers of people <ub>affected</ub>, as well as from the great difficulty of <uc>reversing</uc> or even <uc>slowing</uc> the process.',1,NULL,NULL),(16,'O','The extreme seriousness of desertification results from the vast <ua>areas</ua> of land and the tremendous <ub>numbers of people</ub> affected, as well as from the great <uc>difficulty</uc> of reversing or even slowing the process.',1,1,1),(17,'S','<ua>He</ua> refused to develop projection technology, reasoning that if <ub>he</ub> made and sold projectors, then <uc>exhibitors</uc> would purchase only one machine-a projector-from him instead of several.',1,NULL,NULL),(18,'V','He <ua>refused to develop</ua> projection technology, <ub>reasoning</ub> that if he made and sold projectors, then exhibitors would <uc>purchase</uc> only one machine-a projector-from him instead of several.',1,NULL,NULL),(19,'O','He refused to develop <ua>p