porary <ua>peoples</ua>, Upper Paleolithic <ub>men and women</ub> believed that <uc>the drawing</uc> of a human image could cause death or injury, and if that were indeed their belief, it might explain why human figures are rarely depicted in cave art.',NULL,1,NULL),(33,'V','Perhaps, like many contemporary peoples, Upper Paleolithic men and women <ua>believed</ua> that the drawing of a human image could <ub>cause</ub> death or injury, and if that were indeed their belief, it might <uc>explain</uc> why human figures are rarely depicted in cave art.',1,NULL,NULL),(34,'O','Perhaps, like many contemporary peoples, Upper Paleolithic men and women believed that <ua>the drawing</ua> of a human image could cause <ub>death or injury</ub>, and if that were indeed their belief, it might explain why human figures are rarely depicted in cave art.',1,1,NULL),(35,'O','<ua>Continued sedimentation</ua>—<ub>the process</ub> of deposits’ settling on <uc>the sea bottom</uc>—buries the organic matter and subjects it to higher temperatures and pressures, which convert the organic matter to oil and gas.',1,1,1),(36,'V','Continued sedimentation—the process of deposits’ settling on the sea bottom—<ua>buries</ua> the organic matterand <ub>subjects</ub> it to higher temperatures and pressures, which <uc>convert</uc> the organic matter to oil and gas.',1,1,NULL),(37,'O','Continued sedimentation—the process of deposits’ settling on the sea bottom—buries <ua>the organic matter</ua> and subjects <ub>it</ub> to <uc>higher temperatures and pressures</uc>, which convert the organic matter to oil and gas.',1,1,1),(38,'S','This <ua>scenario</ua> begins with <ub>the planting</ub> of hyperaccumulating species in the target area, such as <uc>an abandoned mine or an irrigation pond</uc> contaminated by runoff.',1,NULL,NULL),(39,'V','This scenario <ua>begins</ua> with the planting of hyperaccumulating species in the target area, such as an <ub>abandoned</ub> mine or an irrigation pond <uc>contaminated</uc>