uences of rocks sometimes <uc>differed</uc> from region to region and that no rock type was ever going to become a reliable time marker throughout the world.',NULL,1,NULL),(54,'S','Physiological <ua>immaturity</ua> may be part of why <ub>infants and toddlers</ub> do not form extremely enduring <uc>memories</uc>, even when they hear stories that promote such remembering in preschoolers.',1,NULL,NULL),(55,'V','Physiological immaturity <ua>may be</ua> part of why infants and toddlers <ub>do not form</ub> extremely enduring memories, even when they <uc>hear</uc> stories that promote such remembering in preschoolers.',1,NULL,NULL),(56,'O','Physiological immaturity may be <ua>part</ua> of why <ub>infants and toddlers</ub> do not form extremely enduring <uc>memories</uc>, even when they hear stories that promote such remembering in preschoolers.',1,NULL,NULL),(57,'S','As a result of crustal adjustments and faulting, <ua>the Strait of Gibraltar</ua>, where the <ub>Mediterranean</ub> now connects to the Atlantic, opened, and <uc>water</uc> cascaded spectacularly back into the Mediterranean.',1,NULL,1),(58,'V','As a result of crustal adjustments and faulting, the Strait of Gibraltar, where the Mediterranean now <ua>connects</ua> to the Atlantic, <ub>opened</ub>, and water <uc>cascaded</uc> spectacularly back into the Mediterranean.',NULL,1,NULL),(59,'O','As a result of crustal <ua>adjustments and faulting</ua>, the Strait of Gibraltar, where the Mediterranean now connects to <ub>the Atlantic</ub>, opened, and water cascaded spectacularly back into <uc>the Mediterranean</uc>.',NULL,NULL,1),(60,'S','Like the <ua>stone</ua> of Roman wall, which were held together both by <ub>the regularity</ub> of the design and by that peculiarly powerful Roman <ub>cement</ub>, so the various <uc>parts</uc> of the Roman realm were bonded into a massive, monolithic entity by physical, organizational, and psychological controls.',NULL,NULL,1),(61,'V','Like the stone of Roman wall, which <ua>were 