cally deposited substances that are affected by <cg>climate</cg> can indicate climate variations over time.','Over long periods of time, <ua>substances</ua> whose physical and chemical properties change with the <ub>ambient climate</ub> at the time can be deposited in a systematic way to provide a continuous record of <uc>changes in those properties</uc> overtime, sometimes for hundreds or thousands of years.',NULL,1,NULL),(96,'O','Changes in systematically deposited substances that are affected by climate can indicate <cg>climate variations</cg> over time.','Over long periods of time, substances whose physical and chemical properties <ua>change with the ambient climate</ua> at the time <ub>can be deposited in a systematic way</ub> to provide a <uc>continuous record of changes in those properties</uc> overtime, sometimes for hundreds or thousands of years.',1,NULL,NULL),(97,'S','<cg>Functional applied-art objects</cg> cannot vary much from the basic patterns determined by the laws of physics.','Since the <ua>laws of physics</ua>, not some arbitrary decision, have determined <ub>the general form of applied-art objects</ub>, they follow basic patterns, so much so that <uc>functional forms</uc> can vary only within certain limits.',NULL,1,1),(98,'O','Functional applied-art objects cannot vary much from <cg>the basic patterns</cg> determined by the laws of physics.','Since the <ua>laws of physics</ua>, not some arbitrary decision, have determined <ub>the general form of applied-art objects</ub>, they follow <uc>basic patterns</uc>, so much so that functional forms can vary only within certain limits.',NULL,NULL,1),(99,'O','Functional applied-art objects cannot vary much from the basic patterns determined by <cg>the laws of physics</cg>.','Since the <ua>laws of physics</ua>, not some arbitrary decision, have determined <ub>the general form of applied-art objects</ub>, <uc>they</uc> follow basic patterns, so much so that functional forms can vary only within certain limits.',1,NULL,NULL),(100,'S','<cg>People who believe that aggression is necessary and justified</cg> are more likely to act aggressively than those who believe differently.','For example, <ua>people who believe that aggression is necessary and justified</ua>-as during wartime-are likely to act aggressively, whereas <ub>people who believe that a particular war or act of aggression is unjust</ub>, or <uc>who think that aggression is never justified</uc>, are less likely to behave aggressively.',1,NULL,NULL),(101,'S','People who believe that aggression is necessary and justified are more likely to act aggressively than <cg>those who believe differently</cg>.','For example, <ua>people who believe that aggression is necessary and justified</ua>-as during wartime-are likely to act aggressively, whereas <ub>people who believe that a particular war or act of aggression is unjust</ub>, or <uc>who think that aggression is never justified</uc>, are less likely to behave aggressively.',NULL,1,1),(102,'O','The responsibilities of the master to the apprentice went beyond <cg>the teaching of a trade</cg>.','Apprentices were considered <ua>part of the family</ua>, and masters were responsible not only for <ub>teaching their apprentices a trade</ub> but also for providing them <uc>some education</uc> and for supervising their moral behavior.',NULL,1,NULL),(103,'V','The responsibilities of the master to the apprentice <cg>went beyond the teaching of a trade</cg>.','Apprentices were considered part of the family, and masters were responsible not only <ua>for teaching their apprentices a trade</ua> but also <ub>for providing them some education</ub> and <uc>for supervising their moral behavior</uc>.',1,1,1),(104,'V','Opening the mouth to breathe <cg>can reduce the speed</cg> of these fishes.','One potential problem is that <ua>opening the mouth</ua> to breathe <ub>detracts from the streamlining</ub> of these fishes and <uc>tends to slow them down</uc>.',NULL,1,1),(105,'O','The Democrats\' power was greatest in <cg>poorer areas</cg> while the Whigs were strongest in those areas where the market was already fully operating.','The Whigs were strongest <ua>in the towns, cities</ua>, and <ub>those rural areas</ub> that were fully integrated into the market economy, whereas Democrats dominated <uc>areas of semisubsistence farming</uc> that were more isolated and languishing economically.',NULL,NULL,1),(106,'O','The Democrats\' power was greatest in poorer areas while the Whigs were strongest <cg>in those areas where the market was already fully operating</cg>.','The Whigs were strongest <ua>in the towns, cities</ua>, and <ub>those rural areas</ub> that were fully integrated into the market economy, whereas Democrats dominated <uc>areas of semisubsistence farming</uc> that were more isolated and languishing economically.',1,1,NULL),(107,'V','The Fore also <cg>displayed</cg> familiar facial expressions when asked how they would respond if they were the characters in stories that called for basic emotional responses.','The Fore <ua>exhibited</ua> the same relationship of facial expressions and basic emotions that <ub>is seen</ub> in Western culture when they <uc>acted out</uc> stories.',1,NULL,NULL),(108,'O','Although they seem <cg>permanent</cg>, hills and mountains exist for a relatively short period of geological time.','Hills and mountains are often regarded as <ua>the epitome of permanence</ua>, successfully <ub>resisting the destructive forces of nature</ub>, but in fact they tend to be <uc>relatively short-lived</uc> in geological terms.',1,1,NULL),(109,'O','Although they seem permanent, hills and mountains exist for a <cg>relatively short period</cg> of geological time.','Hills and mountains are often regarded as <ua>the epitome of permanence</ua>, successfully <ub>resisting the destructive forces of nature</ub>, but in fact they tend to be <uc>relatively short-lived</uc> in geological terms.',1,1,NULL),(110,'S','Because their seeds grow in places where competing plants are no longer present, <cg>dandelions</cg> are classified as opportunists.','<ua>These plants</ua> are termed opportunists because <ub>they</ub> rely on their seeds’ falling into settings where <uc>competing plants</uc> have been removed by natural processes, such as along an eroding riverbank, on landslips, or where a tree falls and creates a gap in the forest canopy.',1,1,NULL),(111,'V','Because their seeds grow in places where competing plants are no longer present, dandelions <cg>are classified as</cg> opportunists.','These plants <ua>are termed</ua> opportunists because they rely on their seeds’ falling into settings where competing plants <ub>have been removed</ub> by natural processes, such as along an eroding riverbank, on landslips, or where a tree <uc>falls and creates</uc> a gap in the forest canopy.',1,NULL,NULL),(112,'O','Because their seeds grow in <cg>places where competing plants are no longer present</cg>, dandelions are classified as opportunists.','These plants are termed opportunists because they rely on their seeds’ falling into settings <ua>where competing plants have been removed by natural processes</ua>, such as <ub>along an eroding riverbank</ub>, on landslips, or where <uc>a tree falls and creates a gap in the forest canopy</uc>.',1,1,1),(113,'S','Some of <cg>the best locations</cg> for large wind farms are places that may cause problems for migrating birds and birds of prey.','Large wind farms might also interfere with <ua>the flight patterns</ua> of migratory birds in <ub>certain areas</ub>, and they have killed large birds of prey (especially hawks, falcons, and eagles) that prefer to hunt along <uc>the same ridge lines</uc> that are ideal for wind turbines.',NULL,NULL,1),(114,'S','Until recently, nobody realized that <cg>Earth</cg> is exposed to unpredictable violent impacts from space.','Earth is <ua>a target in a cosmic shooting gallery</ua>, subject to <ub>random violent events</ub> that were unsuspected <uc>a few decades ago</uc>.',1,NULL,NULL),(115,'O','Until recently, nobody realized that Earth is exposed to <cg>unpredictable violent impacts</cg> from space.','Earth is <ua>a target in a cosmic shooting gallery</ua>, subject to <ub>random violent events</ub> that were unsuspected <uc>a few decades ago</uc>.',NULL,1,NULL),(116,'V','Fuller <cg>was more interested</cg> in dance’s visual impact than in its narrative or emotional possibilities.','Although her early theatrical career <ua>had included</ua> stints as an actress, she <ub>was not primarily interested</ub> in storytelling or expressing emotions through dance; the drama of her dancing <uc>emanated</uc> from her visual effects.',NULL,1,1),(117,'O','Fuller was more interested in <cg>dance’s visual impact</cg> than in its narrative or emotional possibilities.','Although her early theatrical career had included stints as an actress, she was not primarily interested in <ua>storytelling</ua> or <ub>expressing emotions</ub> through dance; the drama of her dancing emanated from <uc>her visual effects</uc>.',NULL,NULL,1),(118,'O','Fuller was more interested in dance’s visual impact than in its <cg>narrative</cg> or emotional possibilities.','Although her early theatrical career had included stints as an actress, she was not primarily interested in <ua>storytelling</ua> or <ub>expressing emotions</ub> through dance; the drama of her dancing emanated from <uc>her visual effects</uc>.',1,NULL,NULL),(119,'O','Fuller was more interested in dance’s visual impact than in its narrative or <cg>emotional possibilities</cg>.','Although her early theatrical career had included stints as an actress, she was not primarily interested in <ua>storytelling</ua> or <ub>expressing emotions</ub> through dance; the drama of her dancing emanated from <uc>her visual effects</uc>.',NULL,1,NULL);
