INSERT INTO `tf_svo3` VALUES (1,NULL,'Under <ua>very cold conditions</ua>, rocks can be shattered by ice and frost. Glaciers may form <ub>in permanently cold areas</ub>, and these slowly moving masses of ice cut out valleys, carrying with them huge quantities of eroded rock debris. Under <cg>different climatic conditions</cg>, another type of destructive force contributes to erosion. <uc>In dry areas</uc> the wind is the principal agent of erosion. It carries fine particles of sand, which bombard exposed rock surfaces, thereby wearing them into yet more sand. Even living things contribute to the formation of landscapes. Tree roots force their way into cracks in rocks and, in so doing, speed their splitting. In contrast, the roots of grasses and other small plants may help to hold loose soil fragments together, thereby helping to prevent erosion by the wind.',1,1,1),(2,'2','Under very cold conditions, rocks can be shattered by ice and frost. Glaciers may form in permanently cold areas, and <ua>these slowly moving masses of ice cut out valleys</ua>, carrying with them huge quantities of eroded rock debris. Under different climatic conditions, <cg>another type of destructive force contributes to erosion</cg>. In dry areas <ub>the wind is the principal agent of erosion</ub>. It carries fine particles of sand, which bombard exposed rock surfaces, thereby wearing them into yet more sand. Even living things contribute to the formation of landscapes. <uc>Tree roots force their way into cracks in rocks</uc> and, in so doing, speed their splitting. In contrast, the roots of grasses and other small plants may help to hold loose soil fragments together, thereby helping to prevent erosion by the wind.',NULL,1,NULL),(3,NULL,'Under very cold conditions, rocks can be shattered by ice and frost. Glaciers may form in permanently cold areas, and these slowly moving masses of ice cut out valleys, carrying with them huge quantities of eroded rock debris. Under different climatic conditions, another type of destructive force contributes to erosion. In dry areas the wind is the principal agent of erosion. It carries fine particles of sand, which bombard exposed rock surfaces, thereby wearing them into yet more sand. Even <cg>living things</cg> contribute to the formation of landscapes. <ua>Tree roots</ua> force their way into cracks in rocks and, in so doing, speed their splitting. In contrast, the roots of grasses and <ub>other small plants</ub> may help to hold loose <uc>soil fragments</uc> together, thereby helping to prevent erosion by the wind.',1,1,NULL),(4,NULL,'Although origin in ritual has long been the most popular, it is by no means the only theory about how the theater came into being. <cg>Storytelling</cg> has been proposed as one alternative. Under this theory, <ua>relating and listening to stories</ua> are seen as fundamental human pleasures. To enhance their listeners’ enjoyment, storytellers continually make their stories more engaging and memorable. Thus, <ub>the recalling of an event</ub> (a hunt, battle, or other feat) is elaborated through <uc>the narrator’s pantomime and impersonation</uc> and eventually through each role being assumed by a different person.',NULL,1,1),(5,NULL,'Although origin in ritual has long been the most popular, it is by no means the only theory about how the theater came into being. Storytelling has been proposed as one alternative. Under this theory, <ua>relating and listening to stories</ua> are seen as <cg>fundamental human pleasures</cg>. To enhance their listeners’ enjoyment, storytellers continually <ub>make their stories more engaging and memorable</ub>. Thus, <uc>the recalling of an event</uc> (a hunt, battle, or other feat) is elaborated through the narrator’s pantomime and impersonation and eventually through each role being assumed by a different person.',1,NULL,NULL),(6,NULL,'Modern architectural forms generally have <cg>three separate components</cg> comparable to <ua>elements of the human body</ua>; <ub>a supporting skeleton or frame</ub>, an outer skin enclosing the <uc>interior spaces</uc>, and equipment, similar to the body’s vital organs and systems. The equipment includes plumbing, electrical wiring, hot water, and air-conditioning. Of course in early architecture—such as igloos and adobe structures—there was no such equipment, and the skeleton and skin were often one. However, some modern architectural designs, such as those using folded plates of concreter or air-inflated structures, are again unifying skeleton and skin.',NULL,1,1),(7,NULL,'Modern architectural forms generally have three separate components comparable to elements of the human body; a supporting skeleton or frame, an outer skin enclosing the interior spaces, and <cg>equipment</cg>, similar to the body’s vital organs and systems. The equipment includes <ua>plumbing</ua>, electrical wiring, <ub>hot water</ub>, and <uc>air-conditioning</uc>. Of course in early architecture—such as igloos and adobe structures—there was no such equipment, and the skeleton and skin were often one. However, some modern architectural designs, such as those using folded plates of concreter or air-inflated structures, are again unifying skeleton and skin.',1,1,1),(8,NULL,'Modern architectural forms generally have three separate components comparable to elements of the human body; a supporting skeleton or frame, an outer skin enclosing the interior spaces, and equipment, similar to the body’s vital organs and systems. The equipment includes plumbing, electrical wiring, hot water, and air-conditioning. Of course in <cg>early architecture</cg>—such as <ua>igloos</ua> and <ub>adobe structures</ub>—there was no such equipment, and the skeleton and skin were often one. However, <uc>some modern architectural designs</uc>, such as those using folded plates of concreter or air-inflated structures, are again unifying skeleton and skin.',1,1,NULL),(9,NULL,'<cg>The reaction of farmers to the inevitable depletion of the Ogallala varies</cg>. Many have been <ua>attempting to conserve water</ua> by irrigating less frequently or by switching to crops that require less water. Others, however, have adopted the philosophy that <ub>it is best to use the water while it is still economically profitable</ub> to do so and to concentrate on high-value crops such as cotton. The incentive of the farmers who wish to conserve water is reduced by their knowledge that many of their neighbors are profiting by using great amounts of water, and in the process are <uc>drawing down the entire region’s water supplies</uc>. But even if uncooperative farmers were to join in the conservation efforts, this would only delay the depletion of the aquifer.',1,1,1),(10,NULL,'Ecologists are especially interested to know what factors contribute to the resilience of communities because climax communities all over the world are being severely damaged or destroyed by human activities. In fact, damage to the environment by humans is often much more severe than damage by <cg>natural events and processes</cg>. <ua>The destruction caused by the volcanic explosion of Mount St. Helens</ua>, in the northwestern United States, for example, pales in comparison to <ub>the destruction caused by humans</ub>. We need to know what aspects of a community are most important to <uc>the community’s resistance to destruction</uc>, as well as its recovery.',1,NULL,NULL),(11,NULL,'Since 1980, the use of wind to produce electricity has been growing rapidly. In 1994 there were nearly 20,000 wind turbines worldwide, most grouped in clusters called wind farms that collectively produced 3,000 megawatts of electricity. Most were in Denmark (which got 3 percent of its electricity from wind turbines) and California (where 17,000 machines produced 1 percent of the state’s electricity, enough to meet the residential needs of a city as large as <ua>San Francisco</ua>). In principle, all the power needs of the United States could be provided by exploiting the wind potential of just <cg>three states</cg>—North Dakota, <ub>South Dakota</ub>, and Texas. Some companies in the power industry are aware of this wider possibility and are planning sizable wind-farm projects in states other than <uc>California</uc>.',NULL,1,NULL),(12,NULL,'Since 1980, <cg>the use of wind to produce electricity has been growing rapidly</cg>. In 1994 <ua>there were nearly 20,000 wind turbines worldwide</ua>, most grouped in clusters called <ub>wind farms that collectively produced 3,000 megawatts of electricity</ub>. Most were in Denmark (which got 3 percent of its electricity from wind turbines) and California (where 17,000 machines produced 1 percent of the state’s electricity, <uc>enough to meet the residential needs</uc> of a city as large as San Francisco). In principle, all the power needs of the United States could be provided by exploiting the wind potential of just three states—North Dakota, South Dakota, and Texas. Some companies in the power industry are aware of this wider possibility and are planning sizable wind-farm projects in states other than California.',1,1,1),(13,'2','Nearly any kind of plant of the forest understory can be part of a deer\'s diet. Where the forest inhibits the growth of <ua>grass and other meadow plants</ua>, the black-tailed deer browses on <ub>huckleberry, salal, dogwood, and almost any other shrub or herb</ub>. But this is fair-weather feeding. What keeps the black-tailed deer alive in the harsher seasons of plant decay and dormancy? One compensation for not hibernating is the built-in urge to migrate. Deer may move from  high-elevation browse areas in summer down to the lowland areas in late fall. There <cg>food is available and accessible throughout the winter</cg>. Even with snow on the ground, the high bushy understory is exposed; also snow and wind bring down <uc>leafy branches of cedar, hemlock, red alder, and other arboreal fodder</uc>.',NULL,NULL,1),(14,NULL,'Scientists have known for some time that certain plants, called hyperaccumulators, can concentrate minerals at levels a hundredfold or greater than normal. <cg>Certain minerals</cg> are more likely to be accumulated in large quantities than others. A survey of known <ua>hyperaccumulators</ua> identified that 75 percent of them amassed <ub>nickel</ub>, cobalt, copper, zinc, manganese, lead, and <uc>cadmium</uc> are other minerals of choice. Hyperaccumulators run the entire range of the plant world. They may be herbs, shrubs, or trees. Many members of the mustard family, spurge family, legume family, and grass family are top hyperaccumulators. Many are found in tropical and subtropical areas of the world, where accumulation of high concentrations of metals may afford some protection against plant-eating insects and microbial pathogens.',NULL,1,1),(15,NULL,'Scientists have known for some time that certain plants, called hyperaccumulators, can concentrate minerals at levels a hundredfold or greater than normal. Certain minerals are more likely to be accumulated in large quantities than others. A survey of known hyperaccumulators identified that 75 percent of them amassed nickel, cobalt, copper, zinc, manganese, lead, and cadmium are other minerals of choice. <cg>Hyperaccumulators</cg> run the entire range of the plant world. They may be <ua>herbs, shrubs, or trees</ua>. Many members of the mustard family, spurge family, <ub>legume family</ub>, and <uc>grass family</uc> are top hyperaccumulators. Many are found in tropical and subtropical areas of the world, where accumulation of high concentrations of metals may afford some protection against plant-eating insects and microbial pathogens.',1,1,1),(16,NULL,'Speculation on the origin of these Pacific islanders began as soon as outsiders encountered them, in the absence of solid linguistic, archaeological, and biological data, many <cg>fanciful and mutually exclusive theories</cg> were devised. <ua>Pacific islanders are variously thought to have come from North America</ua>, South America, Egypt, Israel, and India, as well as Southeast Asia. Many older theories implicitly deprecated the navigational abilities and overall cultural creativity of the Pacific islanders. For example, British anthropologists G. Elliot Smith and W. J. Perry assumed that <ub>only Egyptians would have been skilled enough to navigate and colonize the Pacific</ub>. They inferred that the Egyptians even crossed the Pacific to found the great civilizations of the New World (North and South America). Later theories concentrate on journeys in the other direction. In 1947 Norwegian adventurer Thor Heyerdahl drifted on a balsa-log raft westward with the winds and currents across the Pacific from South America to prove his theory that <uc>Pacific islanders were Native Americans</uc> (also called American Indians).',1,1,1),(17,NULL,'Later <cg>Heyerdahl suggested that the Pacific was peopled by three migrations</cg>: <ua>by Native Americans from the Pacific Northwest of North America drifting to Hawaii</ua>, by Peruvians drifting to Easter Island, and <ub>by Melanesians</ub>. In 1969 he crossed the Atlantic in an Egyptian-style reed boat to prove Egyptian influences in the Americas. Contrary to these theorists, the overwhelming evidence of physical anthropology, linguistics, and archaeology shows that the <uc>Pacific islanders came from Southeast Asia</uc> and were skilled enough as navigators to sail against the prevailing winds and currents.',1,1,NULL),(18,NULL,'One interpretation regarding the absence of fossils during this important 100-million-year period is that early animals were soft bodied and simply did not fossilize. Fossilization of soft-bodied animals is less likely than fossilization of hard-bodied animals, but it does occur. It is relatively rare because the fossilization of soft-bodied animals requires a <cg>special environment</cg>. Conditions that promote fossilization of soft-bodied animals include <ua>very rapid covering by sediments</ua> that create <ub>an environment that discourages decomposition</ub>. In fact, <uc>fossil beds containing soft-bodied animals</uc> have been known for many years.',1,1,NULL),(19,NULL,'What do you remember about your life before you were three? Few people can remember anything that happened to them in their early years. Adults\' memories of the next few years also tend to be scanty. Most people remember only <cg>a few events</cg>—usually ones that were meaningful and distinctive, such as <ua>being hospitalized</ua> or <ub>a sibling’s birth</ub>. Other important occasions are <uc>school graduations and weddings</uc>.',1,1,1),(20,NULL,'<cg>Watt\'s steam engine soon showed what it could do</cg>. It <ua>liberated industry from dependence on running water</ua>. The factories did not have to go to the streams when power could come to the factories. The engine <ub>eliminated water in the mines by driving efficient pumps</ub>, which made possible deeper and deeper mining. The ready availability of coal <uc>inspired William Murdoch during the 1790s to develop the first new form of nighttime illumination</uc> to be discovered in a millennium and a half. Coal gas rivaled smoky oil lamps and flickering candles, and early in the new century, well-to-do Londoners grew accustomed to gaslit houses and even streets. Iron manufacturers, which had starved for fuel while depending on charcoal, also benefited from ever-increasing supplies of coal: blast furnaces with steam-powered bellows turned out more iron and steel for the new machinery. Steam became the motive force of the Industrial Revolution as coal and iron ore were the raw materials.',1,1,NULL),(21,NULL,'The city of Teotihuacán, which lay about 50 kilometers northeast of modern-day Mexico City, began <cg>its growth</cg> by 200-100 B.C. At its height, between about A.D. 150 and 700, it probably had <ua>a population of more than 125,000 people</ua> and covered at least 20 square kilometers. It had over 2,000 apartment complexes, a great market, a large number of industrial workshops, <ub>an administrative center</ub>, a number of massive religious edifices, and a regular grid pattern of streets and buildings. Clearly, much planning and central control were involved in the expansion and ordering of this great metropolis. Moreover, the city had economic and perhaps religious contacts with <uc>most parts of Mesoamerica</uc> (modern Central America and Mexico). In fact, artifacts and pottery from Teotihuacán have been discovered in sites as far away as the Mayan lowlands, the Guatemalan highlands, northern Mexico, and the Gulf Coast of Mexico.',1,1,NULL),(22,NULL,'The city of Teotihuacán, which lay about 50 kilometers northeast of modern-day Mexico City, began its growth by 200-100 B.C. At its height, between about A.D. 150 and 700, it probably had a population of more than 125,000 people and covered at least 20 square kilometers. It had over 2,000 apartment complexes, a great market, a large number of industrial workshops, <ua>an administrative center</ua>, <ub>a number of massive religious edifices</ub>, and <uc>a regular grid pattern of streets and buildings</uc>. Clearly, <cg>much planning and central control were involved</cg> in the expansion and ordering of this great metropolis. Moreover, the city had economic and perhaps religious contacts with most parts of Mesoamerica (modern Central America and Mexico). In fact, artifacts and pottery from Teotihuacán have been discovered in sites as far away as the Mayan lowlands, the Guatemalan highlands, northern Mexico, and the Gulf Coast of Mexico.',1,1,1),(23,NULL,'Photographic evidence suggests that liquid water once existed in great quantity on the surface of Mars. Two types of flow features are seen: <cg>runoff channels</cg> and outflow channels. Runoff channels are found <ua>in the southern highlands</ua>. These flow features are extensive systems—<ub>sometimes hundreds of kilometers in total length<ub>—of interconnecting, twisting channels that seem to merge into larger, wider channels. They bear <uc>a strong resemblance to river systems on Earth</uc>, and geologists think that they are dried-up beds of long-gone rivers that once carried rainfall on Mars from the mountains down into the valleys. Runoff channels on Mars speak of a time 4 billion years ago  (the age of the Martian highlands), when the atmosphere was thicker, the surface warmer, and liquid water widespread.',1,1,1),(24,NULL,'Outflow channels are probably relics of catastrophic flooding on Mars long ago. <cg>These landscape features differ from runoff channels in a number of ways</cg>. They appear only in equatorial regions and <ua>generally do not form extensive interconnected networks</ua>. Instead, they are probably <ub>the paths taken by huge volumes of water</ub> draining from the southern highlands into the northern plains. The onrushing water arising from these flash floods likely also <uc>formed the odd teardrop-shaped “islands”</uc> (resembling the miniature versions seen in the wet sand of our beaches at low tide) that have been found on the plains close to the ends of the outflow channels. Judging from the width and depth of the channels, the flow rates must have been truly enormous—perhaps as much as a hundred times greater than the 105 tons per second carried by the great Amazon river. Flooding shaped the outflow channels approximately 3 billion years ago, about the same times as the northern volcanic plains formed.',1,1,NULL),(25,NULL,'However, changing teachers’ thinking about reflection will not succeed unless there is support for reflection in the teaching environment. Wildman and Niles identify <cg>three principles</cg> that facilitate reflective practice in a teaching situation. The first is <ua>support from administrators</ua> in an education system, enabling teachers to understand the requirements of reflective practice and how it relates to teaching students. The second is <ub>the availability of sufficient time and space</ub>. The teachers in the program described how they found it difficult to put aside the immediate demands of others in order to give themselves the time they needed to develop their reflective skills. The third <uc>is the development of a collaborative environment</uc> with support from other teachers. Support and encouragement were also required to help teachers in the program cope with aspects of their professional life with which they were not comfortable. Wildman and Niles make a summary comment: “Perhaps the most important thing we learned is the idea of the teacher-as-reflective-practitioner will not happen simply because it is a good or even compelling idea.”',1,1,1),(26,NULL,'The differences in feeding preferences lead, in turn, to differences in migratory habits. The wildebeests follow, in their migration, the pattern of local rainfall. The other species do likewise. But when a new area is fueled by rain, the mammals migrate toward it in a set order to exploit it. <cg>The sequence in which they migrate correlates with their body size</cg>. <ua>The larger, less fastidious feeders, the zebras, move in first</ua>; the choosier, smaller wildebeests come later; and <ub>the smallest species of all, Thomson’s gazelle, arrives last</ub>. The later species all depend on the preparations of the earlier one, for <uc>the actions of the zebra alter the vegetation</uc> to suit the stomachs of the wildebeest, topi, and gazelle.',1,1,NULL),(27,NULL,'As her technological expertise grew more sophisticated, so did the <cg>other aspects of her dances</cg>. <ua>Although she gave little thought to music in her earliest dances</ua>, she later used scores by Gluck, Beethoven, Schubert, Chopin, and Wagner, eventually graduating to Stravinsky, Faure, Debussy, and Mussorgsky, composers who were then considered progressive. <ub>She began to address more ambitious themes in her dances</ub> such as The Sea, in which her dancers invisibly agitated a huge expanse of silk, played upon by colored lights. Always open to scientific and technological innovations, she befriended the scientists Marie and Pierre Curie upon their discovery of radium and created a Radium Dance, which simulated the phosphorescence of that element. For all her originality in dance, <uc>her interests expanded beyond it into newly emerging artistic media</uc>. She both appeared in films—then in an early stage of development—and made them herself; the hero of her fairy-tale film Le Lys de la Vie (1919) was played by Rene Clair, later a leading French film director.',1,1,1),(28,NULL,'Icebergs are ordinarily blue to white, although they sometimes appear dark or opaque because they carry gravel and bits of rock. They may change color with changing light conditions and cloud cover, glowing pink or gold in the morning or evening light, but this color change is <ua>generally related to the low angle of the Sun above the horizon</ua>. However, travelers to Antarctica have repeatedly reported seeing green icebergs in the Weddell Sea and, more commonly, close to the Amery Ice Shelf in East Antarctica. Scientists have differed as to whether icebergs appear green as <cg>a result of light conditions</cg> or because of something in the ice itself. One explanation for green icebergs <ub>attributes their color to an optical illusion</ub> when blue ice is illuminated by a near-horizon red Sun, but green icebergs stand out among white and blue icebergs under a great variety of light conditions. Another suggestion is that the color <uc>might be related to ice with high levels of metallic compounds</uc>, including copper and iron. Recent expeditions have taken ice samples from green icebergs and ice cores—vertical, cylindrical ice samples reaching down to great depths—from the glacial ice shelves along the Antarctic continent. Analyses of these cores and samples provide a different solution to the problem.',NULL,1,NULL),(29,NULL,'Icebergs are ordinarily blue to white, although they sometimes appear dark or opaque because they carry gravel and bits of rock. They may change color with changing light conditions and cloud cover, glowing pink or gold in the morning or evening light, but this color change is <ua>generally related to the low angle of the Sun above the horizon</ua>. However, travelers to Antarctica have repeatedly reported seeing green icebergs in the Weddell Sea and, more commonly, close to the Amery Ice Shelf in East Antarctica. Scientists have differed as to whether icebergs appear green as a result of light conditions or because of <cg>something in the ice itself</cg>. One explanation for green icebergs <ub>attributes their color to an optical illusion</ub> when blue ice is illuminated by a near-horizon red Sun, but green icebergs stand out among white and blue icebergs under a great variety of light conditions. Another suggestion is that the color <uc>might be related to ice with high levels of metallic compounds</uc>, including copper and iron. Recent expeditions have taken ice samples from green icebergs and ice cores—vertical, cylindrical ice samples reaching down to great depths—from the glacial ice shelves along the Antarctic continent. Analyses of these cores and samples provide a different solution to the problem.',NULL,NULL,1),(30,NULL,'Trade between the West and the settled and prosperous Chinese dynasties introduced new forms and different technologies. One of the most far-reaching examples is the impact of the fine ninth-century AD. Chinese porcelain wares imported into the Arab world. So admired were these pieces that they encouraged the development of earthenware made in imitation of porcelain and instigated research into the method of their manufacture. Foreign trade was also responsible for <cg>certain innovations in coloring</cg>. From the Middle East <ua>the Chinese acquired a blue pigment</ua> —a purified form of cobalt oxide unobtainable at that time in China—that contained only a low level of manganese. <ub>Cobalt ores found in China have a high manganese content</ub>, which <uc>produces a more muted blue-gray color</uc>. In the seventeenth century, the trading activities of the Dutch East India Company resulted in vast quantities of decorated Chinese porcelain being brought to Europe, which stimulated and influenced the work of a wide variety of wares, notably Delft. The Chinese themselves adapted many specific vessel forms from the West, such as bottles with long spouts, and designed a range of decorative patterns especially for the European market.',1,NULL,NULL),(31,NULL,'Lichens helped to speed the decomposition of the hard rock surfaces, preparing a soft bed of soil that was abundantly supplied with minerals that had been carried in the molten rock from the bowels of Earth. Now, other forms of life could take hold: ferns and mosses (two of the most ancient types of land plants) that <ua>flourish even in rock crevices</ua>. These plants propagate by producing spores–tiny fertilized cells that contain all the instructions for making a new plant–but <ub>the spore are unprotected by any outer coating and carry no supply of nutrient</ub>. So since <cg>the chances of survival for any individual spore are small<cg>, the plants have to produce many spores in order to propagate. <uc>Vast numbers of them fall on the ground beneath the mother plants</uc>. Sometimes they are carried farther afield by water or by wind. But only those few spores that settle down in very favorable locations can start new life; the vast majority fall on barren ground. By force of sheer numbers, however, the mosses and ferns reached Hawaii, survived, and multiplied. Some species developed great size, becoming tree ferns that even now grow in the Hawaiian forests.',NULL,1,NULL),(32,NULL,'<cg>The development of banking and other financial services</cg> contributed to the expansion of trade. By the middle of the sixteenth century, <ua>financiers and traders commonly accepted bills of exchange</ua> in place of gold or silver for other goods. Bills of exchange, which had their origins in medieval Italy, were <ub>promissory notes</ub> (written promises to pay a specified amount of money by a certain date) that could be sold to third parties. In this way, they provided <uc>credit</uc>. At mid-century, an Antwerp financier only slightly exaggerated when he claimed, “One can no more trade without bills of exchange than sail without water.\" Merchants no longer had to carry gold and silver over long, dangerous journeys. They could also avoid having to identify and assess the value of a wide variety of coins issued in many different places. An Amsterdam merchant purchasing soap from a merchant in Marseille could go to an exchanger and pay the exchanger the equivalent sum in guilders, the Dutch currency. The exchanger would then send a bill of exchange to a colleague in Marseille, authorizing the colleague to pay the Marseille merchant in the merchant\'s own currency after the actual exchange of goods had taken place.',1,1,1),(33,NULL,'The development of banking and other financial services contributed to <cg>the expansion of trade</cg>. By the middle of the sixteenth century, financiers and traders commonly accepted bills of exchange in place of gold or silver for other goods. Bills of exchange, which had their origins in medieval Italy, were promissory notes (written promises to pay a specified amount of money by a certain date) that could be sold to third parties. In this way, they <ua>provided credit</ua>. At mid-century, an Antwerp financier only slightly exaggerated when he claimed, “One can no more trade without bills of exchange than sail without water.\" Merchants <ub>no longer had to carry gold and silver over long, dangerous journeys</ub>. They could also <uc>avoid having to identify and assess the value of a wide variety of coins issued in many different places</uc>. An Amsterdam merchant purchasing soap from a merchant in Marseille could go to an exchanger and pay the exchanger the equivalent sum in guilders, the Dutch currency. The exchanger would then send a bill of exchange to a colleague in Marseille, authorizing the colleague to pay the Marseille merchant in the merchant\'s own currency after the actual exchange of goods had taken place.',NULL,1,1);
