INSERT INTO `tf_svo4` VALUES (1,'2','Before 1815 manufacturing in the United States had been done in homes or shops by skilled artisans. As master craft workers, <ua>they imparted the knowledge of their trades to apprentices and journeymen</ua>. In addition, women often worked in their homes part-time, <ub>making finished articles from raw material supplied by merchant capitalists</ub>. After 1815 this older form of manufacturing began to give way to <uc>factories with machinery tended by unskilled or semiskilled laborers</uc>. <cg>This new form of manufacturing</cg> depended on the movement of goods to distant locations and a centralized source of laborers. Cheap transportation networks, the rise of cities, and the availability of capital and credit all stimulated the shift to factory production.',NULL,NULL,1),(2,'1','<ua>Extinct but already fully marine cetaceans are known from the fossil record</ua>. <ub>How was the gap between a walking mammal and a swimming whale bridged</ub>? <cg>This is a question</cg> that has puzzled scientists for ages. <uc>Missing until recently were fossils clearly intermediate, or transitional, between land mammals and cetaceans</uc>.',NULL,1,NULL),(3,'2','<ua>The raising of livestock</ua> is <ub>a major economic activity</ub> in semiarid lands, where grasses are generally the dominant type of <uc>natural vegetation</uc>. <cg>This economic reliance</cg> on livestock in certain regions makes large tracts of land susceptible to overgrazing. The consequences of an excessive number of livestock grazing in an area are the reduction of the vegetation cover and the trampling and pulverization of the soil. This is usually followed by the drying of the soil and accelerated erosion.',1,1,NULL),(4,'2','The raising of livestock is a major economic activity in semiarid lands, where grasses are generally the dominant type of natural vegetation. This economic reliance on livestock in certain regions makes large tracts of land susceptible to overgrazing. <ua>The consequences of an excessive number of livestock grazing</ua> in an area are <ub>the reduction of the vegetation cover</ub> and <uc>the trampling and pulverization of the soil</uc>. <cg>This</cg> is usually followed by the drying of the soil and accelerated erosion.',1,1,1),(5,'1','<ua>Exhibitors</ua>, however, wanted to maximize their profits, which <cg>they</cg> could do more readily by projecting a handful of <ub>films</ub> to hundreds of <uc>customers</uc> at a time (rather than one at a time) and by charging 25 to 50 cents admission. About a year after the opening of the first Kinetoscope parlor in 1894, showmen such as Louis and Auguste Lumiere, Thomas Armat and Charles Francis Jenkins, and Orville and Woodville Latham (with the assistance of Edison\'s former assistant, William Dickson) perfected projection devices. These early projection devices were used in vaudeville theaters, legitimate theaters, local town halls, makeshift storefront theaters, fairgrounds, and amusement parks to show films to a mass audience. When this widespread use of projection technology began to hurt his Kinetoscope business, Edison acquired a projector developed by Armat and introduced it as “Edison’s latest marvel, the Vitascope.\"',1,NULL,NULL),(6,'1','Exhibitors, however, wanted to maximize their profits, which they could do more readily by projecting a handful of films to hundreds of customers at a time (rather than one at a time) and by charging 25 to 50 cents admission. About a year after the opening of the first Kinetoscope parlor in 1894, <cg>showmen</cg> such as Louis and <ua>Auguste Lumiere</ua>, Thomas Armat and Charles Francis Jenkins, and Orville and <ub>Woodville Latham</ub> (with the assistance of Edison\'s former assistant, <uc>William Dickson</uc>) perfected projection devices. These early projection devices were used in vaudeville theaters, legitimate theaters, local town halls, makeshift storefront theaters, fairgrounds, and amusement parks to show films to a mass audience. When this widespread use of projection technology began to hurt his Kinetoscope business, Edison acquired a projector developed by Armat and introduced it as “Edison’s latest marvel, the Vitascope.\"',1,1,NULL),(7,'2','Exhibitors, however, wanted to maximize their profits, <ua>which they could do more readily by projecting a handful of films to hundreds of customers</ua> at a time (rather than one at a time) and by charging 25 to 50 cents admission. About a year after the opening of the first Kinetoscope parlor in 1894, showmen such as Louis and Auguste Lumiere, Thomas Armat and Charles Francis Jenkins, and Orville and Woodville Latham (with the assistance of Edison\'s former assistant, William Dickson) perfected projection devices. <ub>These early projection devices were used in vaudeville theaters</ub>, <uc>legitimate theaters, local town halls, makeshift storefront theaters, fairgrounds, and amusement parks to show films to a mass audience</uc>. When <cg>this widespread use of projection technology</cg> began to hurt his Kinetoscope business, Edison acquired a projector developed by Armat and introduced it as “Edison’s latest marvel, the Vitascope.\"',NULL,1,1),(8,'2','During Jackson\'s second term, his opponents had gradually come together to form <ua>the Whig party</ua>. <cg>This new party</cg> argued against the policies of Jackson and <ub>his party</ub> in a number of important areas, beginning with the economy. Whigs and <uc>Democrats</uc> held different attitudes toward the changes brought about by the market, banks, and commerce. The Democrats tended to view society as a continuing conflict between \"the people” -farmers, planters, and workers-and a set of greedy aristocrats. This \"paper money aristocracy\" of bankers and investors manipulated the banking system for their own profit, Democrats claimed, and sapped the nation\'s virtue by encouraging speculation and the desire for sudden, unearned wealth. The Democrats wanted the rewards of the market without sacrificing the features of a simple agrarian republic. They wanted the wealth that the market offered without the competitive, changing society; the complex dealing; the dominance of urban centers; and the loss of independence that came with it.',1,NULL,NULL),(9,'2','During Jackson\'s second term, his opponents had gradually come together to form the Whig party. This new party argued against the policies of Jackson and his party in a number of important areas, beginning with the economy. Whigs and Democrats held different attitudes toward the changes brought about by the market, banks, and commerce. The Democrats tended to view society as a continuing conflict between \"<ua>the people</ua>” -farmers, planters, and workers-and a set of greedy aristocrats. This \"paper money aristocracy\" of <ub>bankers and investors</ub> manipulated the banking system for their own profit, <uc>Democrats</uc> claimed, and sapped the nation\'s virtue by encouraging speculation and the desire for sudden, unearned wealth. The Democrats wanted the rewards of the market without sacrificing the features of a simple agrarian republic. <cg>They</cg> wanted the wealth that the market offered without the competitive, changing society; the complex dealing; the dominance of urban centers; and the loss of independence that came with it.',NULL,NULL,1),(10,'2','Most investigators concur that <ua>certain facial expressions</ua> suggest <ub>the same emotions in all people</ub>. Moreover, <uc>people in diverse cultures recognize the emotions</uc> manifested by the facial expressions. <cg>This universality in the recognition of emotions</cg> was demonstrated by using rather simple methods. In classic research Paul Ekman took photographs of people exhibiting the emotions of anger, disgust, fear, happiness, and sadness. He then asked people around the world to indicate what emotions were being depicted in them. Those queried ranged from European college students to members of the Fore, a tribe that dwells in the New Guinea highlands. All groups, including the Fore, who had almost no contact with Western culture, agreed on the portrayed emotions. The Fore also displayed familiar facial expressions when asked how they would respond if they were the characters in stories that called for basic emotional responses. Ekman and his colleagues more recently obtained similar results in a study of ten cultures in which participants were permitted to report that multiple emotions were shown by facial expressions. The participants generally agreed on which two emotions were being shown and which emotion was more intense.',NULL,NULL,1),(11,'2','Most investigators concur that certain facial expressions suggest the same emotions in all people. Moreover, people in diverse cultures recognize the emotions manifested by the facial expressions. This universality in the recognition of emotions was demonstrated by using rather simple methods. In classic research Paul Ekman took photographs of people exhibiting the emotions of anger, disgust, fear, happiness, and sadness. He then asked people around the world to indicate what emotions were being depicted in <ua>them</ua>. <cg>Those quried</cg> ranged from <ub>European college students</ub> to members of the Fore, a tribe that dwells in the New Guinea highlands. <uc>All groups, including the Fore</uc>, who had almost no contact with Western culture, agreed on the portrayed emotions. The Fore also displayed familiar facial expressions when asked how they would respond if they were the characters in stories that called for basic emotional responses. Ekman and his colleagues more recently obtained similar results in a study of ten cultures in which participants were permitted to report that multiple emotions were shown by facial expressions. The participants generally agreed on which two emotions were being shown and which emotion was more intense.',NULL,1,1),(12,'2','The Psychodynamic Approach. Theorists adopting the psychodynamic approach hold that inner conflicts are crucial for understanding human behavior, including aggression. Sigmund Freud, for example, believed that aggressive impulses are inevitable reactions to the frustrations of daily life. Children normally desire to vent aggressive impulses on other people, including their parents, because even the most attentive parents cannot gratify all of their demands immediately. Yet <ua>children</ua>, also fearing their parents\' punishment and the loss of parental love, come to repress most aggressive impulses. According to Freud, however, impulses that have been repressed continue to exist and demand expression. The Freudian perspective, in a sense: sees us as \"<ub>steam engines</ub>.\" By holding in rather than venting \"steam,\" we set the stage for future explosions. <uc>Pent-up aggressive impulses</uc> demand outlets. <cg>They</cg> may be expressed toward parents in indirect ways such as destroying furniture, or they may be expressed toward strangers later in life.',NULL,NULL,1),(13,'1','Because they are always swimming, tunas simply have to open their mouths and water is forced in and over their gills. Consequently, <ua>tunas</ua> do not need to suck in water. Accordingly, they have lost <ub>most of the muscles</ub> that <uc>other fishes</uc> use to suck in water and push it past the gills. In fact, tunas must swim to breathe. <cg>They</cg> must also keep swimming to keep from sinking, since most have largely or completely lost the swim bladder, the gas-filled sac that helps most other fish remain buoyant. ',1,NULL,NULL),(14,'2','Under very cold conditions, <ua>rocks</ua> can be shattered by ice and frost. <ub>Glaciers</ub> may form in permanently cold areas, and <uc>these slowly moving masses of ice</uc> cut out valleys, carrying with <cg>them</cg> huge quantities of eroded rock debris. Under different climatic conditions, another type of destructive force contributes to erosion. In dry areas the wind is the principal agent of erosion. It carries fine particles of sand, which bombard exposed rock surfaces, thereby wearing them into yet more sand. Even living things contribute to the formation of landscapes. Tree roots force their way into cracks in rocks and, in so doing, speed their splitting. In contrast, the roots of grasses and other small plants may help to hold loose soil fragments together, thereby helping to prevent erosion by the wind.',NULL,1,1),(15,'2','<ua>Much of the water</ua> in a sample of <ub>water-saturated sediment or rock</ub> will drain from it if <uc>the sample</uc> is put in a suitable dry place. But <cg>some</cg> will remain, clinging to all solid surfaces. It is held there by the force of surface tension without which water would drain instantly from any wet surface, leaving it totally dry. The total volume of water in the saturated sample must therefore be thought of as consisting of water that can, and water that cannot, drain away. What, then, determines what proportion of the water stays and what proportion drains  away?',1,NULL,NULL),(16,'1','Much of the water in a sample of water-saturated sediment or rock will drain from it if the sample is put in <ua>a suitable dry place</ua>. But <ub>some</ub> will remain, clinging to all <uc>solid surfaces</uc>. <cg>It</cg> is held there by the force of surface tension without which water would drain instantly from any wet surface, leaving it totally dry. The total volume of water in the saturated sample must therefore be thought of as consisting of water that can, and water that cannot, drain away. What, then, determines what proportion of the water stays and what proportion drains  away?',NULL,1,NULL),(17,NULL,'Much of the water in a sample of water-saturated sediment or rock will drain from it if the sample is put in a <ua>suitable dry place</ua>. But some will remain, clinging to all <ub>solid surfaces</ub>. It is held there by <uc>the force of surface tension</uc> without <cg>which</cg> water would drain instantly from any wet surface, leaving it totally dry. The total volume of water in the saturated sample must therefore be thought of as consisting of water that can, and water that cannot, drain away. What, then, determines what proportion of the water stays and what proportion drains  away?',NULL,NULL,1),(18,'2','Although <ua>origin in ritual</ua> has long been the most popular, <ub>it</ub> is by no means the only theory about how the theater came into being. <uc>Storytelling</uc> has been proposed as one alternative. Under <cg>this theory</cg>, relating and listening to stories are seen as fundamental human pleasures. To enhance their listeners’ enjoyment, storytellers continually make their stories more engaging and memorable. Thus, the recalling of an event (a hunt, battle, or other feat) is elaborated through the narrator’s pantomime and impersonation and eventually through each role being assumed by a different person.',NULL,NULL,1),(19,'2.5','Above the tree line there is a zone that is generally called alpine tundra. Immediately adjacent to the timberline, the tundra consists of a fairly complete cover of low-lying shrubs, herbs, and grasses, while higher up the number and diversity of species decrease until there is much bare ground with occasional mosses and lichens and some prostrate cushion plants. <ua>Some plants can even survive in favorable microhabitats</ua> above the snow line. <ub>The highest plants in the world occur at around 6,100 meters</ub> on Makalu in the Himalayas. At this great height, <uc>rocks, warmed by the sun, melt small snowdrifts</uc>. <cg>This</cg> explains how, for example, alpine cushion plants have been found growing at an altitude of 6,180 meters.',NULL,NULL,1),(20,'2.5','Opportunists must constantly invade new areas to compensate for being displaced by more competitive species. Human landscapes of lawns, fields, or flowerbeds provide settings with bare soil and a lack of competitors that are perfect habitats for colonization by opportunists. Hence, <ua>many of the strongly opportunistic plants are the common weeds</ua> of fields and gardens. Because </ub>each individual is short-lived</ub>, the population of an opportunist species is likely to be adversely affected by <uc>drought, bad winters, or floods</uc>. <cg>Such episodic events</cg> will cause a population of dandelions, for example, to vary widely. If their population is tracked through time, it will be seen to be particularly unstable—soaring and plummeting in irregular cycles. ',NULL,NULL,1),(21,NULL,'Since 1980, <ua>the use of wind</ua> to produce electricity has been growing rapidly. In 1994 there were nearly 20,000 <ub>wind turbines</ub> worldwide, most grouped in clusters called <uc>wind farms</uc> that collectively produced 3,000 megawatts of electricity. <cg>Most</cg> were in Denmark (which got 3 percent of its electricity from wind turbines) and California (where 17,000 machines produced 1 percent of the state’s electricity, enough to meet the residential needs of a city as large as San Francisco). In principle, all the power needs of the United States could be provided by exploiting the wind potential of just three states—North Dakota, South Dakota, and Texas. Some companies in the power industry are aware of this wider possibility and are planning sizable wind-farm projects in states other than California.',NULL,NULL,1),(22,'2','One of the most puzzling aspects of the paintings is their location. Other rock paintings—for example, those of Bushmen <ua>in South Africa</ua>—are either <ub>located near cave entrances</ub> or <uc>completely in the open</uc>. <cg>This</cg> made it easy for the artists to paint and display them for the rest of the cave dwellers. Cave paintings in France and Spain, however, are in recesses and caverns far removed from original cave entrances. This means that artists were forced to work in cramped spaces and without sources of natural light. It also implies that whoever made them did not want them to be easily found. Since cave dwellers normally lived close to entrances, there must have been some reason why so many generations of Lascaux cave dwellers hid their art.',NULL,1,1),(23,'2','The subjects of the paintings are mostly animals. The paintings rest on bare walls, with no backdrops or environmental trappings. Perhaps, like many contemporary peoples, Upper Paleolithic men and women believed that the drawing of a <ua>human image could cause death or injury</ua>, and if that were indeed their belief, it might explain why <ub>human figures are rarely depicted in cave art</ub>. Another explanation for the focus on animals might be that <uc>these people sought to improve their luck at hunting</uc>. <cg>This theory</cg> is suggested by evidence of chips in the painted figures, perhaps made by spears thrown at the drawings. But if improving their hunting luck was the chief motivation for the paintings, it is difficult to explain why only a few show signs of having been speared. Therefore, if the paintings were connected with hunting, some other explanation is needed. Perhaps the paintings were inspired by the need to increase the supply of animals. Cave art seems to have reached a peak toward the end of the Upper Paleolithic period, when the herds of game were decreasing. ',NULL,NULL,1),(24,'2','Continued sedimentation—the process of deposits’ settling on the sea bottom—buries the organic matter and subjects it to higher temperatures and pressures, which convert the organic matter to oil and gas. As muddy sediments are pressed together, the gas and small droplets of oil may be squeezed out of the mud and <ua>may move into sandy layers</ua> nearby. Over long periods of time (millions of years), accumulations of gas and oil can <ub>collect in the sandy layers<ub>. Both oil and gas are less dense than water, so they generally tend to <uc>rise upward</uc> through water-saturated rock and sediment. Unless something acts to halt <cg>this migration</cg>, these natural resources will eventually reach the surface.',NULL,NULL,1),(25,'2','Impacts by meteorites represent one mechanism that could cause global catastrophes and seriously influence the evolution of life all over the planet. According to some estimates, the majority of all extinctions of species may be due to such impacts. Such a perspective fundamentally changes our view of biological evolution. The standard criterion for the survival of a species is <ua>its success in competing with other species</ua> and <ub>adapting to slowly changing environments</ub>. <cg>This</cg> is the criterion emphasized by Darwin\'s theory of evolution by natural selection. Yet an equally important criterion is <uc>the ability of a species to survive random global ecological catastrophes</uc> due to impacts.',1,1,1),(26,'2','Scientists have known for some time that certain plants, called hyperaccumulators, can concentrate minerals at levels a hundredfold or greater than normal. Certain minerals are more likely to be accumulated in large quantities than others. A survey of known hyperaccumulators identified that 75 percent of them amassed nickel, cobalt, copper, zinc, manganese, lead, and cadmium are <ua>other minerals of choice</ua>. <ub>Hyperaccumulators</ub> run the entire range of the plant world. <cg>They</cg> may be herbs, shrubs, or trees. <uc>Many members of the mustard family</uc>, spurge family, legume family, and grass family are top hyperaccumulators. Many are found in tropical and subtropical areas of the world, where accumulation of high concentrations of metals may afford some protection against plant-eating insects and microbial pathogens.',NULL,1,1),(27,'2','Speculation on the origin of these Pacific islanders began as soon as outsiders encountered them, in the absence of solid linguistic, archaeological, and biological data, many fanciful and mutually exclusive theories were devised. Pacific islanders are variously thought to have come from North America, South America, Egypt, Israel, and India, as well as Southeast Asia. Many older theories implicitly deprecated the navigational abilities and overall cultural creativity of the <ua>Pacific islanders</ua>. For example, <ub>British anthropologists</ub> G. Elliot Smith and W. J. Perry assumed that only <uc>Egyptians</uc> would have been skilled enough to navigate and colonize the Pacific. <cg>They</cg> inferred that the Egyptians even crossed the Pacific to found the great civilizations of the New World (North and South America). Later theories concentrate on journeys in the other direction. ',NULL,1,NULL),(28,'2','One interpretation regarding <ua>the absence of fossils</ua> during this important 100-million-year period is that early animals were soft bodied and simply did not fossilize. <ub>Fossilization of soft-bodied animals</ub> is less likely than <uc>fossilization of hard-bodied animals</uc>, but it does occur. <uc>It</uc> is relatively rare because the fossilization of soft-bodied animals requires a special environment. Conditions that promote fossilization of soft-bodied animals include very rapid covering by sediments that create an environment that discourages decomposition. In fact, fossil beds containing soft-bodied animals have been known for many years. ',NULL,1,NULL),(29,'2','Not only could Smith identify rock strata by the fossils they contained, he could also see a pattern emerging: certain fossils always appear in more <ua>ancient sediments</ua>, while others begin to be seen as the strata become more recent. By following the fossils, Smith was able to put all <ub>the strata of England\'s earth into relative temporal sequence</ub>. About the same time, Georges Cuvier made <uc>the same discovery</uc> while studying the rocks around Paris. <cg>The findings</cg> of these geologists inspired others to examine the rock and fossil records in different parts of the world. Soon it was realized that this principle of faunal (animal) succession was valid not only in England or France but virtually everywhere. It was actually a principle of floral succession as well, because plants showed the same transformation through time as did fauna. Limestone may be found in the Cambrian or—300 million years later—in the Jurassic strata, but a trilobite—the ubiquitous marine arthropod that had its birth in the Cambrian—will never be found in Jurassic strata, nor a dinosaur in the Cambrian.',NULL,1,1),(30,'2','Modern attitudes to Roman civilization range from the infinitely impressed to <ua>the thoroughly disgusted</ua>. As always, there are the <ub>power worshippers</ub>, especially among historians, who are predisposed to admire whatever is strong, who feel more attracted to the might of Rome than to the subtlety of <uc>Greece</uc>. <cg>They</cg> esteem symbols of Roman power, such as the massive Colosseum. At the same time, there is a solid body of opinion that dislikes Rome. For many, Rome is at best the imitator and the continuator of Greece on a larger scale. Greek civilization had quality; Rome, mere quantity. Greece was original; Rome, derivative. Greece had style; Rome had money. Greece was the inventor; Rome, the research and development division. Such indeed was the opinion of some of the more intellectual Romans. “Had the Greeks held novelty in such disdain as we,” asked Horace in his epistle, “what work of ancient date would now exist?”',NULL,1,NULL),(31,'2','The diffusion of agriculture and later of iron was accompanied by a great movement of people who may have carried these innovations. <ua>These people</ua> probably originated in eastern Nigeria. Their migration may have been set in motion by an increase in population caused by a movement of peoples fleeing the desiccation, or drying up, of the Sahara. <ub>These people</ub> had a significant linguistic impact on the continent as well. <uc>They</uc> spoke a language, proto-Bantu  (“Bantu” means “the people”), which is the parent tongue of a language of a large number of Bantu languages still spoken throughout sub-Sahara Africa. Why and how <cg>these people</cg> spread out into central and southern Africa remains a mystery, but archaeologists believe that their iron weapons allowed them to conquer their hunting-gathering opponents, who still used stone implements. Still, the process is uncertain, and peaceful migration—or simply rapid demographic growth—may have also caused the Bantu explosion. ',1,1,1),(32,'2','Ir has not been common at Earth’s since the very beginning of the planet’s history. Because it usually exists in a metallic state, it was preferentially incorporated in Earth’s core as the planet cooled and consolidated. <ua>Ir is found in high concentrations in some meteorites</ua>, in which the solar system’s original chemical composition is preserved. Even today, microscopic meteorites continually bombard Earth, falling on both land and sea. By <ub>measuring how many of these meteorites fall to Earth</ub> over a given period of time, scientists can estimate <uc>how long it might have taken to deposit the observed amount of Ir</uc> in the boundary clay. <cg>These calculations</cg> suggest that a period of about one million years would have been required. However, other reliable evidence suggests that the deposition of the boundary clay could not have taken one million years. Consequently, the idea that the Ir in the boundary clay came from microscopic meteorites cannot be accepted. So the unusually high concentration of Ir seems to require a special explanation. ',NULL,1,1),(33,'2','<ua>Outflow channels</ua> are probably relics of catastrophic flooding on Mars long ago. <ub>These landscape features</ub> differ from <uc>runoff channels</uc> in a number of ways. <cg>They</cg> appear only in equatorial regions and generally do not form extensive interconnected networks. Instead, they are probably the paths taken by huge volumes of water draining from the southern highlands into the northern plains. The onrushing water arising from these flash floods likely also formed the odd teardrop-shaped “islands” (resembling the miniature versions seen in the wet sand of our beaches at low tide) that have been found on the plains close to the ends of the outflow channels. Judging from the width and depth of the channels, the flow rates must have been truly enormous—perhaps as much as a hundred times greater than the 105 tons per second carried by the great Amazon river. Flooding shaped the outflow channels approximately 3 billion years ago, about the same times as the northern volcanic plains formed.',1,1,NULL),(34,'1','<ua>Lichens</ua> helped to speed the decomposition of the hard rock surfaces, preparing a soft bed of soil that was abundantly supplied with minerals that had been carried in the molten rock from the bowels of Earth. Now, <ub>other forms of life</ub> could take hold: <uc>ferns and mosses</uc> (two of the most ancient types of land plants) that flourish even in rock crevices. <cg>These plants</cg> propagate by producing spores–tiny fertilized cells that contain all the instructions for making a new plant–but the spore are unprotected by any outer coating and carry no supply of nutrient. So since the chances of survival for any individual spore are small, the plants have to produce many spores in order to propagate. Vast numbers of them fall on the ground beneath the mother plants. Sometimes they are carried farther afield by water or by wind. But only those few spores that settle down in very favorable locations can start new life; the vast majority fall on barren ground. By force of sheer numbers, however, the mosses and ferns reached Hawaii, survived, and multiplied. Some species developed great size, becoming tree ferns that even now grow in the Hawaiian forests.',1,NULL,1),(35,'1','<ua>Trade between the West and the settled and prosperous Chinese dynasties</ua> introduced new forms and <ub>different technologies</ub>. One of the most far-reaching examples is the impact of the fine ninth-century AD. <uc>Chinese porcelain wares</uc> imported into the Arab world. So admired were these pieces that <cg>they</cg> encouraged the development of earthenware made in imitation of porcelain and instigated research into the method of their manufacture. Foreign trade was also responsible for certain innovations in coloring. From the Middle East the Chinese acquired a blue pigment —a purified form of cobalt oxide unobtainable at that time in China—that contained only a low level of manganese. Cobalt ores found in China have a high manganese content, which produces a more muted blue-gray color. In the seventeenth century, the trading activities of the Dutch East India Company resulted in vast quantities of decorated Chinese porcelain being brought to Europe, which stimulated and influenced the work of a wide variety of wares, notably Delft. The Chinese themselves adapted many specific vessel forms from the West, such as bottles with long spouts, and designed a range of decorative patterns especially for the European market.',NULL,NULL,1);
